BEGIN;
INSERT INTO `bowuguan` VALUES ('1', 'Human Evolution', '人类演化史', 'It is a long process for primitive men becoming modern people. This is a stereo\rscene about human evolution. There comes an anthropoid who says hello to us. They picked fruits on tree to feed their family. After they invented stone implements, they hunted animals for food. Then, people used ironware on farming. In industrial age, people had a good life by diverse tools. Nowadays, in information era, people seek time and efficiency with profession, scale development and technology. As a result, the more advanced the tools are, the more significant improvement on human civilization.  \r	The development of ancient humans includes 4 steps: Ape-man, Homo habilis, Homo erectus and Homo sapiens. Shuidonggou people belong to late Homo sapiens that existed from 40,000 years ago to 10,000 years ago. Their appearance looks like the 4th model. That means Shuidonggou people experienced the late of Paleolithic Age and the early of Neolithic Age. From period of picking fruits to hunting animals, they also developed from shaping stone implements to polishing stone implements.  \rThe development of ancient humans includes 4 steps: Ape-man, Homo habilis, Homo erectus and Homo sapiens. At the very beginning, humans were large primates. They climbed trees with arms and legs and walked with the assist of both hands. During the process of evolution, they could walk upright and hands were freed. While the proportion of upper body decreased, sex differences increased, cranial capacity gradually increased. With the contraction of lower jawbone, their faces grew flat and their pilus gradually disappeared, which finally become our appearance today. The ancient people living in Shuidonggou belong to late Homo sapiens. They are also known as modern people in anatomy, which is the last stage of primitive man. Evolution of human beings from early ape man to late Homo sapiens has undergone a very long history of 2.5 million years. The tools people used in this period is simple stone implements. This period is called Paleolithic Age.', '人类从原始人进化到现代人，历经了漫长的过程，这里您可以看到人类进化的立体演绎场景：向我们打招呼的古猿告诉我们，采摘树上的果实是古人类最早的食物来源之一，发明了石器以后才有了狩猎活动，铁器的出现促进了农耕的发展，现代人生产工具的多样性，使得生活也更加丰富多彩。信息时代，生产已经达到了专业化、规模化和科技化的程度，追求的是时间和效率……工具的不断更新促使人类文明的脚步不断地加快！\r从人类进化场景可以看出在人类进化的历史长河中，古人类发展主要经历了四个发展阶段：依次是猿人、能人、直立人和智人，智人又分为早期智人和晚期智人。水洞沟人属于晚期智人，距今约4万年，他的体貌特征介于第四个人物模型，生产工具开始从打制石器向磨制石器变革，也就是说水洞沟人经历了旧石器晚期和新时器时代。\r人类进化根据体貌形态变化分为四个阶段：猿人、能人、直立人和智人，人类最初是大型灵长类动物，它们用四肢攀爬树木，双手辅助行走。在进化的过程中，双手解放出来，两足直立行走，上身比例减小，两性特征趋于明显，脑容量逐渐增大，下颌骨收缩，面部趋于扁平，体毛渐渐退去，最后就变成我们如今的模样。水洞沟人属于晚期智人，也被称为解剖学上的现代人，是原始人的最后一个阶段。人类从早期猿人到晚期智人共经历了250万年的漫长历史，这个时期的人使用的工具是简单的石器工具，也被称为旧石器时代。\r', '/renleiship.mp3', '/renleishiy.mp3', '/renleishif.mp3', null), ('2', 'Paleolithic Age of China', '中国旧石器时代', 'From 1920, China found thousands of relics in Paleolithic Age. Those relics spread all over China, from east of China - Liaoning province, south of China – Yunnan Province, West of China – Qinghai province, north of China – Inner Mongolia, the maximum relics distribution located in Yellow River region. So, Chinese called Yellow River as Mother River. The representatives are relics of Yuanmou human in Yunnan province, relics of Lantian human in Shanxi province, relics of Peking man in Beijing, relics of Ding Villege in Shanxi province, relics of Nihe Bay in Hebei Province and Relics of Shuidonggou in Ningxia Province. Among them, Zhoukou Dian in Beijing, Nihe Bay in Hebei and Shuidonggou in Ningxia are the top three relics in China because of the importance on researching Paleolithic era. You could dig more referenced with panel right in front. \r\rIn showcase below, we can enjoy several stone implements from different relics. The size of those implements is large, so we called them as “Heavy Duty Implements”. In general, those stone implements are easier and rough by hand-made. For a while, we will watch the tools, which Shuidonggou people used before. We called them as “Light Duty Implements” because of its small size and high degree of elaboration. \r\rMeanwhile, we can also notice primitive men’s decorations in Matriarchal Society. First of all, there is delicate decorations came from Peking Upper Cave Men. They lived close to Bohai Bay and liked to seek shell, so they drilled holes on shells and animals teeth, then install them in series by using plants’ stem. Compared with Peking Upper Cave Men, Shuidonggou people also knew how to decorate themselves, the pendant made of ostrich eggs is much more delicate. Now, let’s come in the region of Shuidonggou relics.', '从上世纪20年代至今，中国共发现上千处旧石器时代遗址，我们可以看到，这些遗址遍布在全国各地，东起辽宁，南及云南，西到青海，北到内蒙，以黄河河流域分布最为密集，所以又有黄河是母亲河的说法。其中有代表性的为:云南元谋人遗址，陕西蓝田人遗址，北京人遗址，山西丁村人遗址、河北泥河湾遗址和宁夏水洞沟遗址。要说对中国旧石器遗址研究的重要性和受关注的程度，以北京周口店、河北泥河湾和宁夏水洞沟遗址为首。您可以参考对面的展板资料作以详细的了解。\r在下方展柜里，我们也可以欣赏到不同的遗址中发掘出土的一些石器，这些石器体积较大，我们把他们称为“重型工具”，通常这种石器加工简单、粗糙。而我们稍后也会看到水洞沟人所使用的工具，这些工具体型较小，而且规整美观，我们把它们称为“轻型工具”。\r同时，在展柜里我们也会欣赏到人类进化在进入母系氏族社会时，原始人所佩戴的装饰品，首先展出的是北京山顶洞人精美的装饰品，山顶洞遗址距离渤海湾比较近，在加上它们群体人数多，活动范围广，可能经常去海边活动并拣一些贝壳，所以今天我们看到装饰品是由贝壳和动物的牙齿打磨穿孔之后组成的，当时，它们会用植物的根茎将其串联在一起，挂在脖子或腰间。三万年前的水洞沟人同样懂得装饰自己，他们制作的鸵鸟蛋皮装饰品已经不止是精美了，而是精致。接下来，我们就进入水洞沟遗址区，了解水洞沟文化。\r', '/jiushiqip.mp3', '/jiushiqiy.mp3', '/jiushiqif.mp3', null), ('3', 'ulture of Shuidonggou', '水洞沟文化', 'In 1919, Preacher Kent from Belgium prepared to go to Shanxi from Ningxia. Along with the Ning Salt Road in Linhe villege, he found a skull of woolly rhinoceros and a piece of stone made by quartz. In 1923, Kent met Rihua Sang who was dean of Tianjin North Frontier Museum and also a paleontologist from France. On Jun 11st 1923, Rihua Sang and his friend Rijin De bagan this journey from Tianjin. They walked forward along with the Yellow River and went across Wula Mountain. After residing in the lodge of Zhangsan, they began scientific research and excavation.  \r\rAfter supper, Rihua Sang and Rijin De were eager to find something in Shuidonggou. When they reached the Great Wall, they found a skeleton in the bluff of the Great Wall. 10 days later, Zhihua Sang and Rijin De hired a local farmer to dig more than 300 kilogram stone implements like steinkerns, scrapers and pointed-head implements. On account of conflicts and war in China, China could not provided paleontologist with advanced and suitable condition, so those paleontologists wrote serial number for stones, enclosed them into wood cases and delivered them to France. They persisted in cautious research in 5 years. In 1928, Zhihua Sang and Rijin De declared a judgment that China does not have history in Paleolithic Age was terminated. Archaeological circle was shocked by this declaration. Because, before 1928, European insisted on that no history about Paleolithic Age existed in China and Chinese ancestors came from Europe. Consequently, the lodge of Zhangsan became an indispensable part of Shuidonggou. \r\rIn five times excavation in Shuidonggou, archaeologist unearthed more than 50,000 stone implements and more than hundreds of animal fossils. In front of you, stone implements and animal fossils are showed. Let’s watch the first and second animal fossils with large horns. That is megaloceros. The third exhibit is a head fossil from a primitive buffalo. We can speculate that it would be 2-3 tons based on its head fossil. The weight is equivalent of a grown elephant. We can also find fossils of mustang and kiang. According to fossils unearthed from Shuidonggou, we can conclude that environment in Shuidonggou was pretty good at that time. After viewing fossils, let’s see stone implements from Shuidonggou. Typical stone implements include pointed-head implement, scraper and chopping tool. The pointed-head implement looks like arrow. Bigger pointed-head implements could be used for hunting by tied up with wood. Smaller one could be used for drilling holes. The function of scraper is equivalent to knife in modern life. They are used for cutting meat, cutting animal fur from meat and cutting root or stem of plaints. Scraper is very common among chipped stone implements. Chopping tool has large size and unfixed shape. They look like axe nowadays. Chopping tool is used for cutting trees, digging stem of plaints and knock nuts because of its blade and heavy weight.  \r\rIn showcase, one more stone implement would be introduced to you. \r\r\rLevallois sternken，the shape of museum of Shuidonggou relics imitated from it. Levallois steinkern was initially discovered in Levallois-Perret, Paris, France. That’s why it is named Levallois steinkern which belongs to advanced Mousterian culture or growing Aurignacian culture in the middle Paleolithic age in Europe. It is a stone implement chipping technique. Before making stone slices, the surface of the raw stones would be peeled off, leaving the internals that are usually named steinkern. The steinkern would be elaborately trimmed so that one side is flat and the other side is swelling outwards, which looks like an up-side-down tortoise shell. Such steinkern produces multiple stone slices. On average, over 4 slices could be made with thin edges which can be used directly as implements. It represents the most advanced stone implement chipping technique in the world. Because the materials of Shuidonggou stone is similar with materials of Levallois , archaeologist speculated that Shuidonggou people might migrate from Europe. \r\rThe 1st archaeological excavation was in 1923. China’s first archaeological excavation was born here, so Shuidonggou is called ‘the birthplace of prehistoric archaeology in China’. Archaeologists correct the judgment that ‘no history about Paleolithic Age existed in China’. Archaeologists opened the door to explore prehistoric archaeology in China. The 2nd archaeological excavation was orgnized by paleontology expedition between the Soviet Union and China at the beginning of 1960. However, this excavation just lasted almost 1 year, because of political factors. Expedition found those stone implements had characteristics on medium-term of archaeology and late-term of archaeology. In 1963, Mr Wenzhong Pei leaded China Institute of Vertebrate Paleontology and Paleoanthropology expedition and began the 3rd archaeological excavation in Shuidonggou relic. They found polished stone axe and millstone so they demonstrated that the relics of both Paleolithic Age and the Neolithic Age had existed in Shuidonggou. The 4th archaeological excavation was in 1980. The expedition formed by Museum of Ningxia and Ningxia Geological Regional Survey Team reached a decision that Shuidonggou relic belonged to both Paleolithic Age and the Neolithic Age. The 5th archaeological excavation lasted for 5 years from 2003 to 2007. Archaeologists applied advanced measure and technical instrument on finding delicate ornaments made by ostrich eggshells and trace of using fire. This excavation shocked the whole world that was also praised as renaissance on archaeology age in China. \r\rThere are 69 ring shape ornaments unearthed in Shuidonggou. Exquisite ring shape ornaments made by bone pieces and ostrich eggshells are the earliest polished handicrafts in batch process in our country so far. They are the most exquisite handicrafts ever discovered in the Palaeolithic age of our country, which greatly enrich the cultural deposits of Shuidonggou and provide important materials for research into the level of productivity, evolution of technique, the condition of making and using handicraft, as well as behavioral pattern and aesthetic judgment at that time.\r\rAlong the further development of human evolution and productivity, implements used by human beings got more and more advanced. Maybe it is beyond many people’s imagination that the implements used by us now are initially developed from stone implements. Now we would have some knowledge about the development of implements through the display window.\r\r\rThe display window No. 1 reveals the evolution process of modern metal spearhead or arrowhead developed from the chipped pointed-implement to polished stone spear unearthed in Shuidonggou.\r\rThe display window No. 2 shows us the chipped scraping implement to polished stone knife and the trace of development of modern metal knife. \r\rThe display window No. 3 illustrates the evolution process from chipped chopping implement to polished stone axe to modern metal axe.\r\rThe display window No. 4 exhibits the evolution process from chipped jagged-edge implement to polished stone saw, and the final development of modern metal saw.\r', '1919年，比利时传教士肯特，由宁夏银川去往陕西，于横城古渡东渡黄河，沿着“宁盐大道”途经今灵武临河镇时，在黄土层中发现了个披毛犀的头骨和一件石英石器，1923年，肯特在天津遇见了桑志华，便把自己在水洞沟的发现告诉了时任中国天津北疆博物院院长的法国古生物学家、博物馆学家桑志华。1923年6月11日，桑志华连同他的同窗好友德日进从天津出发，沿着黄河左岸西行，穿过乌拉山到达水洞沟，住进了“张三小店”，对水洞沟进行了科学考察和发掘。\r\r当天晚饭后，桑志华和德日进就耐不住内心的急迫，沿着沟底往里走，当他们走到与长城并行的一处断崖时，突然发现断崖上有磷火闪现，丰富的考古知识使他们立即判断出那里一定有尸骨。他们很快返回小店，找到张三，给了他5块银元，要了一把大梯子，在夜色中爬到崖上去挖。第一个晚上，他们就挖到了一件动物头骨化石。后来十几天的时间里，桑志华和德日进雇当地农民一共挖出了300多公斤的石核、刮削器、尖状器等打制石器，由于当时中国身处战乱年代，无法提供先进、适宜的研究条件，他们将石制品精心编号后，装入木箱，运回法国进行深入研究。1928年，他们以严谨的学术态度和科学事实向世界宣布：水洞沟遗址的发现和发掘标志着“中国没有旧石器时代文化”这一论断的终结。水洞沟的此次发现震惊了欧洲考古界，在此之前，西方学者一直认为中国没有旧石器时代，也就是说我们的祖先是从西方迁徙而来的民族。张三小店就此成为水洞沟历史中不可或缺的一部分。\r\r水洞沟从1923年至今共经历了5次考古发掘，共出土了五万多件石器和几百件动物化石。这里展示的就是水洞沟出土的动物化石和石器。我们看一下展柜中第一个和第二个角很大的动物化石，故名大角鹿。第三个是原始牛头化石，从牛头化石的大小推测出原始牛体型很大，将其还原之后有两到三吨，相当于一个成年象的大小。还有野马、野驴化石，从水洞沟出土的动物化石种类大小可以看出，当时水洞沟的生存环境很不错。看完化石，我们来看一看水洞沟出土的代表性石器工具，典型的石器工具主要有尖状器、刮削器和砍斫器。尖状器形似箭头，大一点的尖状器，可以绑在木头顶端，用来投掷工具捕杀猎物，小一些可以用来钻孔；刮削器，功能相当于现在的刀具，一般用于切割肉类、兽皮、分割动物肢体、谷物的根茎，是打制石器中最常见的工具；砍斫器（砍砸器）是旧石器时代的一种形体较大,形状不固定的工具，作用相当于现在的石斧，器身厚重，有钝厚曲折的刃口，可起到砍劈、锤砸和挖掘等多种作用，因而可以用于砍树、做木棒、挖植物块根、砸坚果等工作。\r\r在展柜中，还有一件石器要为大家介绍一下。\r\r勒瓦娄哇石核，水洞沟遗址博物馆外形就是仿制此石器类型建造的。它最早发现在法国巴黎勒瓦娄哇佩雷小镇，因此取名勒瓦娄哇石核。这是一种石器打造技术，在打制石片之前，将原始石料的石皮剥离，留下石头内部，我们一般称之为石核，再把石核经过精心修理使之一面平整一面隆起，像一个倒置龟甲，这样的石核产片率很高，一般均在四片以上，形成长薄规整的石叶状，可直接使用。它代表当时世界最先进石器打制技术，也称发达的莫斯特文化或成长的奥瑞纳文化。由于水洞沟出土的石器材料与上述文化基本相似年代又晚，所以考古专家推断水洞沟人很可能是从欧洲迁徙过来的。\r\r水洞沟出土的环状装饰品共有69件。用骨片和鸵鸟蛋皮制成的精美环状装饰品，是迄今我国发现年代最早的批量生产的磨制工艺品，其精美程度为我国旧石器文化中所仅见，极大地丰富了水洞沟的文化内涵，为研究当时人类生产力发展水平、技术演化、艺术品加工使用情况及其行为模式和审美能力提供了重要资料。\r\r第一次考古发掘是在1923年，也是我国第一次发现旧石器时代遗址，水洞沟因此被称为“中国史前考古发祥地”。此次考古发掘纠正了“中国没有旧石器时代文化”的论断，揭开了中国史前考古的新篇章。第二次考古发掘是由中国和苏联组建的中苏古生物考察队，于1960年开始，并于同一年由于中苏关系恶化而结束。这次从水洞沟发现的石器，在类型上既有旧石器时代中期的文化性质，同时也具有后期的特征；1963年，裴文中先生率领中国古脊椎动物与古人类研究所考察队，对水洞沟遗址进行了第三次考古发掘，在众多出土的石器中发现了磨光的石斧与石磨盘，从而证明水洞沟遗址包含了旧石器与新石器两个不同时代的文化遗存。第四次考古发掘是在1980年，由宁夏博物馆和宁夏地质局区域调查队组成联合发掘队，进一步肯定水洞沟遗址既属于旧石器时代，也属于新石器时代。第五次考古发掘为期五年，于2003年开始到2007年结束，出土了制作精致的鸵鸟蛋皮装饰品化石，发现了史前水洞沟人用火的遗迹，同时运用了与国际接轨的新型考古方法，使用了先进的科学仪器，被中国第四际研究的泰斗刘东生院士高度赞誉为“中国旧石器时代考古学‘文艺复兴’的标志”。\r\r随着人类的进化和生产力的进一步发展，人类使用的工具越来越先进，但是，也许有许多人想象不到我们现在使用的工具，它们最初都是由石器工具演变而来的，下面我们就通过展柜来了解一下工具的演变过程:\r一号展柜中展示的是从水洞沟出土的打制的尖状器到磨制石矛，最后成为现代的金属矛头或箭头演变过程，\r二号展柜中展示的是从水洞沟出土的打制刮削器到磨制石刀，最后发展到现代的金属刀的演变轨迹；\r三号展柜是从打制的砍砸器到磨制石斧至现代金属斧的演变；\r四号展柜是从打制的锯齿刃器工具到磨制的石锯，最后发展到现代金属锯的演变。', '/wenhuap.mp3', '/wenhuay.mp3', '/wenhuaf.mp3', null), ('4', 'Subside 4D-Experience', '动感体验区', 'In front of us, there is an area for 4D experience. You would traverse to experience the scene about people produce and live, flash flood, mountains fall and the earth splits before 40,000 years. Because the scene is really true to life, everyone who has high blood pressure or heart trouble should stay in safe plat to watch. The others are welcomed to walk onto the plat with huge shake.', '前方是下沉式动感体验区，大家可以穿越时光进入4万年前，实景体验原始人的生产生活场景，还可以体验山洪暴发，山崩地裂的震撼效果。由于场面比较逼真，为了您的安全，有高血压，心脏病的游客，请留在安全平台感受，其他朋友请到地震平台体验。', '/dongganqup.mp3', '/dongganquy.mp3', '/dongganquf.mp3', null), ('5', 'Sculpture of the Last Exhibition Hall – Migration', '尾厅雕塑——迁徙', 'It is discovered in the research into the history of ancient humans that after living in one place for a certain period, they would simply disappear. Then it has always been an enigma where had the Shuidonggou people gone after the time of 10,000 years ago. One statement indicates that they extinct due to the deteriorated environment or failing to compete with the original people living there and the possibility of having fusion with aboriginal culture and losing their unique sign. Another statement implies that they migrated back to the north part of Eurasia like Mongolia and Russia etc. After that, part of them reached the American Continent pursuing the environment being rich in water and vegetation. Still another part continued with the migration...leading a vagrant life. They came from the north to the south and went back from the south to the north. Perhaps Shuidonggou people are no difference with other nations in the world in their later migration, mixing with one nation by following the natural law: survival of the fittest. Since the research into the unearthed relics is long process, the monographic study on Shuidonggou site would be gradually deepened. The research reports published then might be able to reveal the truth.', '在古人类历史研究中发现，人类在某一地方生活一个时期后，就会消失不见。那么，水洞沟人哪里去了，一直是考古界的一个谜，一种说法认为他们因环境的恶化或与当地已有人群发生竞争而走向灭绝，也不能排除他们与土著文化发生了融合从而丧失了独特的标志，还有一种说法认为他们又打道北归，到达蒙古、俄罗斯等欧亚大陆北部，之后一部分人因追逐水草丰美的环境到达美洲大陆，还有一部分人继续迁徙……流浪。从北到南、又从南到北，或许水洞沟人在后来的迁徙中和世界上其他民族一样，遵循适者生存的自然法则，融合于某个民族中，由于出土资料研究是一个漫长的过程，水洞沟遗址专题研究也会逐渐深入，在以后的研究报告中，或许能够揭开谜底。', '/qianxip.mp3', '/qianxiy.mp3', '/qianxif.mp3', null), ('6', 'Creative Cave', '创意洞穴', 'Creative Cave was founded by Shuidonggou Scenic Spot and Simple Culture and Creativity Co.Ltd on October 2016. There are rarely 40 products with elements of Shuidonggou. By help of those products, we hope cultural obscure in Old Stone Age would become vivid and easy to understand. Star products are yelling bottle opener, totem color changing umbrella, sun umbrella with stone element, arts of Simple family, Stone Age army knife, postcard, books, pendant of pointed-head implements, wine made by Goji and roses. We put unique stone elements, modern design and practicability from Shuidonggou into our creative products. Some of products have already gotten prizes on travel products design. You cannot only experience variously creative products, but also feel the imagination from designers. \r\rP.S: Shuidonggou VR Game <Mystery Stone from Heaven> is also created by this team.', '创意洞穴是水洞沟景区与北京森魄文化创意有限责任公司共同设计打造的，创意洞穴于2016年10月份开始运营，现在已有将近40款结合水洞沟特色的创意产品，我们希望将原本晦涩难懂的水洞沟远古文化，变得生动又有趣。明星产品有水洞沟“呐喊”瓶起、“万物生长”晴雨两用变色伞、“石器物语”遮阳伞、水洞沟森魄家族树脂摆件、水洞沟石器时代瑞士军刀、水洞沟明信片、水洞沟书籍、尖状器吊坠、枸杞玫瑰酒等产品。产品融入水洞沟特有的石器时代元素，结合现代的设计感和实用性，让您回归到石器产品的本真。产品也多次获得国内旅游创意品设计大赛奖项。在创意洞穴，绝对可以让您体会到各种天马行空、生动有趣的创意产品。P.S：水洞沟HTC VR游戏<天降神石>也是由本团队打造~\r', '/chuangdongp.mp3', '/chuangdongy.mp3', '/chuangdongf.mp3', null), ('7', 'Sculpture – Discovery', '序厅雕塑-发现', 'Now, let’s know about the culture of Shuidonggou from foreword. Shuidonggou is the Holy Land of ancient people 40,000 years ago. In 1923, French paleontologist \rRijin De and Zhihua Sang found huge amount of stone implements and ancient animal fossils in Shuidonggou relics from Paleolithic Age. Therefore, Shuidonggou became the earliest human cultural site of Paleolithic Age and the birthplace of prehistoric archaeology in China. After multiple excavations, archaeologists found more than 50,000 stone implements and more than hundreds animal fossils. The stone artifacts and the skills of making them which are the basement of Shuidonggou Culture could be compared with the artifacts and skills from Moss and Aurignac  in Europe, West Asia and North Africa. After analyzing the process and delicate level from stone artifacts in Shuidonggou, the stone production level of people in Shuidonggou of Ningxia has reached the most advanced level in the world. Shuidonggou is unique in the area about Paleolithic age in China. Citizens of Ningxia, even citizens of China are proud of Shuidonggou.\r\rThe culture of Shuidonggou comes from savage lands, but it really has good influence on later generations. Visitors would have systematic comprehension on the relics of Shuidonggou by watching prehistoric human’s activities and life scene in museum. After experiencing this hard-won history, we believe everyone would cherish and protect such crucial relics further. People in Shuidonggou 40,000 years ago would also be grateful on our behaviors.', '现在我们通过前言了解一下水洞沟文化：水洞沟地区是四万年前人类繁衍生息的圣地。1923年，法国古生物学家德日进、桑志华在这里发现了旧石器时代遗址，出土了大量石器和古生物化石。水洞沟因此而成为我国最早发现的旧石器时代人类文化遗址, 成为中国史前考古的发祥地。此后又经过多次考古发掘, 出土了五万多件石器和上百件动物化石。其中构成水洞沟文化基础的石制品、工具以及石器制作技术,可以和欧洲、西亚和北非的莫斯特、奥瑞纳时期人类栖居地的石器相媲美。从水洞沟出土的石器、装饰品的制作工艺、精致程度分析，在四万年前，宁夏水洞沟人的生产已达到了同时代最先进、最高水平，使用着领先的、精美的石制工具。这种现象, 为我国已发现的旧石器时代晚期文化所仅有。宁夏人民因水洞沟而感到骄傲，中国人民为此而自豪。\r\r水洞沟文化产生于荒蛮，影响于后世。水洞沟遗址博物院通过全面展示史前水洞沟人的生产活动和生活场景，使大家对水洞沟文化遗址有一个较为系统的了解，以增强人们爱护生态环境、保护文物古迹的意识。四万年以前的水洞沟人, 会因为我们对他们的关注和珍爱感到欣慰。\r', '/faxianp.mp3', '/faxiany.mp3', '/faxianf.mp3', null);
COMMIT;

