BEGIN;
INSERT INTO `cangbingdongone` VALUES ('1', 'Troop-Hiding Cave', '藏兵洞', 'Each and every black hole on both sides of the cliff in canyon is the famous scenery spot and historical site called “Troops-Hiding Cave”. The hiding cave actually indicates the move of defending troops at Red Mountain Fort transferring from overground defense to underground defense. It was used to protect the troops and wait for chance to attack the enemies or served as tunnel to ambush troops in open area. The Great Wall, tower, deep ditch, canyon and troop-hiding cave have constituted the only well-preserved ancient three-dimensional military defense system all over the country. The ancient troop-hiding cave in front of us is the relic and prototype of the earliest tunnel warfare in our country. If the tunnel warfare initiated by the 8th Rout Army and guerrilla forces made the enemies terror-stricken and tremble with fear during the War of Resistance against Japan, we can also imagine that the defending troops at the frontier fortress of Ming Dynasty had kept the invaders outside the Great Wall with the same wisdom and courage 500 years ago. The troop-hiding caves are 10 meters above the valley bottom which winding above and below or left and right in the mountain. There are many forks which look like maze in the cave so you cannot see the end. Besides, there are habitable rooms, food storage rooms, wells, kitchen stove, arsenal, powder magazine, traps and concealed weapons in the cave. You can appreciate the tunnel warfare with the unexpected design of the flexible function and the complex structures when you stand in the “troops-hiding cave”. The intelligence of ancient people is thoroughly demonstrated here. It is really amazing! ', '在峡谷两侧悬崖上的一个个黑洞，就是著名的“藏兵洞”，所谓藏兵洞，是红山堡守军由地上转入地下，隐蔽军队，保护自己，伺机出击，或在空旷处设伏兵的地道。这在全国是唯一保存最为完整的古代立体军事防御体系。在我国的长城防御体系中，把长城、城堡和地下藏兵洞紧密联系在一起的防御系统，全国这是独一处。现在展现在大家眼前的藏兵洞是我国最早的地道战遗址和原型。如果说抗战时期，八路军和游击队的地道战能让敌人胆战心惊，闻风丧胆，那么我们可以想象500多年前明代的边塞守军也是以同样的智慧和勇敢将侵略者挡在了长城之外。 奇特的藏兵洞高出沟底10多米，蜿蜒曲折于悬壁之中，上下相通，左右相连，洞中分叉路口颇多，左右盘旋，犹如迷宫久久不见尽头。洞内辟有居室、粮食储藏室、水井、灶台、兵器库、火药库、炮台、陷阱、暗器孔道等设施。置身其中，可立时领略到古地道战在设计上的出人意料、功能上的灵巧隐蔽、结构上的悬妙复杂，古人的聪明才智，在这里体现得淋漓精致，令人叹为观止。', '/1cangbingdp.mp3', '/1cangbingdy.mp3', '/1cangbingdf.mp3', null), ('2', 'Defense Tunnel and Large Trap', '防御洞道及大型陷阱', 'What you are visiting now is a complete defense tunnel. There are no small holes available to place the oil lamp in the wall, which means in Ming Dynasty, the defending troop generally would not enter the tunnel. It is only used to induce the enemies to enter so that they would save some manpower. The large trap in front of you is so many hidden weapons. At that time, they would put sharp-pointed bamboos at the bottom of the trap. The toughness of bamboo is quite incredible, which makes it extremely destructive. \rIn front of the large trap is the concave-convex battlefields and four logs that are purposely made as barriers to retard the attack from the enemies.', '现在您参观的这部分属于一个完整的防御洞道，在这里的墙壁上没有放置油灯的小洞，说明在明代，他们自己人一般不进入，只为诱导敌人进入，以便为自己节省人力。眼前的大型陷阱中，您可以看到很多暗器，当时他们用削尖的竹子置于陷阱底部，竹子的韧性很强，杀伤力很强。\r大型陷阱前方的凹凸阵及四根横木都是一些为减缓敌人进攻速度所设置的障碍物。', '/fangdaxianjingp.mp3', '/fangdaxianjingy.mp3', '/fangdaxianjingf.mp3', null), ('3', 'Meeting Room', '议事厅', 'The commodious place in front of us is a dining room as well as a temporary meeting room intended to save space, which kills two birds with one stone. Here, we can see a cooking bench. This iron cauldron is handed down from Ming Dynasty dating back to 500 years ago. Judging from the size of the cauldron, this should be a dining room that mainly serves for high-ranking military officers, because this cauldron cannot offer enough food for the 251 standing army stationed here. There is an ingenious design above the cooking bench with three smoke chimneys. What are the benefits for such design? On the one hand, it disperses the smoke vented in order to avoid being discovered by enemies on the ground. On the other hand, at least one chimney works regardless of the wind direction so that the smoke won’t be blown back into the cave and poison or suffocate people on their own side.', '眼前这个宽敞的位置是一个餐厅，也是临时的议事厅，一举两得，减少了占用空间，这里可以看到一个灶台，这口大铁锅就是五百年前明代遗留下来的，从锅的大小来看，这里应该主要是供高级将领吃饭的地方，因为驻守此地的常备军为251名，这口锅肯定不够二百多人吃饭。在这个灶台上方还有一个巧妙的设置，有三个出烟口，三个出烟口有什么好处呢，一方面可以分散烟的浓度，防止被地面上的敌人发现，另一方面不管外面风向什么样，总有一个出烟口可以排烟，防止烟刮到洞内熏到他们自己人。\r', '/yishitingp.mp3', '/yishitingy.mp3', '/yishitingf.mp3', null), ('4', 'Powder-Magazine', '火药库', 'The discovery of powder magazine accounts for the use of fired weapons in Ming Dynasty. The gunpowder is the leftover at that time. It has ceased to be effective after being left here for many years. Moreover, due to the difference in ingredients, gunpowder made in Ming Dynasty is not as destructive as that made in modern times.', '火药库的发现，再一次说明热兵器在明代的使用，这些火药都是当时遗留下来的，由于年代太久，现在都已失效，另外，由于配料的关系，明代火药的杀伤力并没有现代火药爆发力强。\r', '/huoyaokup.mp3', '/huoyaokuy.mp3', '/huoyaokuf.mp3', null), ('5', 'Sentry Post and Granary', '哨岗和粮仓', 'The four sentry posts set up here signify the importance of the location since we are reaching the command center. Moreover, the small watch hold in front of us faces right to a hole on the opposite side for ease of mutual signaling and more vigilance. Meanwhile, the earth platform on the posts also prove that soldiers would be guarding here for a long time and be quite laborious. General set it to show consideration for the soldiers. Here is also called”zuogang”. Not far from the sentry post, we found some grains in a small area in a cave. which implies that the Ancient Troop-Hiding Cave is not a permanent troop station. Like the tunnel warfare, these soldiers mainly stay overground for daily life. They would only enter the cave for ambush under emergency condition. Troop-hiding is a strategic means of making concessions in order to gain advantages.\r', '这里设置四个哨岗，说明这个位置比较重要，因为我们即将到达的是指挥中心。另外眼前的这个小型瞭望口直对对面一个洞口，便于互发信号，提高警惕性。另外这些岗位上的土台子也证明站到这里的士兵守卫的时间比较长，特别辛苦，将领为体恤士兵而设置，这里也被形象的称之为“坐岗”。距离坐岗不远处的洞穴中，清理出一些粮食，我们发现，粮仓面积并不大，这说明藏兵洞不是一个永久驻兵的地方，和地道战一样，这些士兵的日常生活以地面为主，在紧急状态下才会进入洞内打伏击，藏兵只是一种以退为进的战略手段。\r', '/liangcangp.mp3', '/liangcangy.mp3', '/liangcangf.mp3', null), ('6', 'Fort Barbette and Observation Tower', '炮台与瞭望台', 'This is the only fort barbette found so far in the Ancient Troop-Hiding Cave. The one seated next to the window is a cannon imported from Spain. It is also the most advanced weapon found in the cave. The discovery of the fort barbette implies that even if the fired weapons are not widely used, it is no longer a cold weapon dominated era, otherwise it would not make much sense for the Ming Dynasty to continue building the Great Wall. Moreover, we notice that the cannon faces the gorge. A single fire could have triggered the collapse of the whole cliff, which would endanger the defending troops as well. Therefore, the cannon would not be used except under extremely critical situation. Next to fort barbette is observation tower. Standing on the tower, we can see many small holes in the cliff facing us. The holes are not natural but man-made ones serving as ventilation function for the Ancient Troop-Hiding Cave. Since the cave is excavated underground, ventilation holes have become critical parts. The use of observation tower not only makes it easier to find the enemy’s situation but also serves as a way to send signals to the soldiers stationed in the hiding cave on the opposite side so that they could ambush the enemies passing through the gorge at a proper time. In addition, to be better covered and avoid being suspected by the enemies, they would grow some plants with dense leaves at the observation tower or at the entrance of the cave. The situation of the gorge could be caught in the cave while it’s quite difficult to find the ambush spot.', '这是目前为止发现的藏兵洞里唯一的一个炮台，窗口边驾着一口土炮是从西班牙进口的弗朗机，它也是藏兵洞内最高级的武器，炮台的发现，说明当时已不是单纯的冷兵器时代，只是热兵器使用并不广泛，否则明代修筑长城就有没多大意义了。而且，我们留意到这口大炮面对着大峡谷，一炮轰过去整个崖壁就会坍塌，对自己的安全也会产生威胁，因此这口炮一般情况下是不会使用的，只有在万不得已的时候才会用到。炮台旁边即是瞭望台，在瞭望台上我们可以看到对面崖壁上有很多的小洞，不是天然形成的，而是人为的，那些就是对面藏兵洞的通风透气口。藏兵洞全部在地下，通风口便成为非常重要的一个组成部分。瞭望台不仅有助于发现敌情，也可以和对面藏兵洞的士兵发送信号，以便选择在恰当的时候将过往的敌人伏击在峡谷之中。另外，为避免引起敌人怀疑，他们会在瞭望台或洞口处种植一些叶子很浓密的植物，加强它的隐蔽性，从洞里面可以看到峡谷的情况，但是从峡谷当中是很难发现这里有伏击之所的。\r', '/liaowangtaip.mp3', '/liaowangtaiy.mp3', '/liaowangtaif.mp3', null), ('7', 'the Second Floor Underground', '地下二层', 'First, you can see the armory, but why the weapons scattered on the ground. Because it’s impossible to carry out the investigation and verification, one possibility is that the Ancient Troop-Hiding cave was once destroyed or backfilled. It was also possible that many people died in the chaos caused by war during the dynastic transitions. We can see a skull wearing helmet was left in the innermost. It’s a dead private soldier from Ming Dynasty. With the rest of the body missing, it is actually not a full body. By then, many minority civilians or soldiers from the north are involved in the war. With the principle of awarding people according to their contributions, the number of chopped-off heads defines the level of contribution. When the private soldier from Ming Dynasty was killed, his head was chopped off and taken away. However, the enemy somehow left the skull that would bring him honor in the armory. War speaks for itself the brutality. We sincerely hope there would be no more war and killing in the world. May peace be kept forever. In front of the water well is the only one we found in the cave. (The well in front of us is the only well we found in the cave.)This water well is their major source of water in the cave. Since the underground water level in Ningxia is deep, water could be only available when the well is built on this layer. We can also see a ring of red incrustation on the ceiling of the cave. Speculation is that it might be generated when the enemies once filled the cave with water from outside. The tunnels we see on the side are not yet cleared up. Other similar tunnels are found in other parts of the cave. There are actually many places yet to be cleared up in the Ancient Troop-Hiding Cave.', '首先您看到的是兵器库，为什么兵器散落一地，这可能由于不可查证的原因，整个藏兵洞遭到了破坏和填埋，也可能是明代衰落时期，很多人死于这种朝代变迁的战乱当中，最里面可以看到有一个戴着头盔的头骨就是有一位明代的普通士兵命丧黄泉了，而且还不是全尸，他的身体并没有找到，当时北方很多少数民族军民合一，论功行赏是以取敌人首级多少来界定的，这名明代普通士兵被杀之后，他的头颅被砍下带走，但是敌人到了兵器库后，不知处于什么原因，丢下了这颗会带给他荣誉的头颅，战争的残忍不言而喻，真心希望世界没有战争，没有杀戮，永远和平。前方是目前洞内发现的唯一一口水井，也为藏兵驻兵提供主要水源，由于宁夏地下水位比较深，因此，只有把井修到下面这层才有水，在洞穴的上方我们还可以看到一圈红色水垢，推测可能是敌人曾经从洞外灌水所致。旁边看到的这样未清理的洞道，在洞内其他地方也有发现，藏兵洞内很多地方还有待于进一步清理.\r', '/dierp.mp3', '/diery.mp3', '/dierf.mp3', null), ('8', 'The General’s Cave', '将军洞', 'The general’s cave is located in the center and is composed of a living room and a bedroom. It is a relatively senior setup which reflects the ancient hierarchy system. The most mysterious part in the cave is the cabinet in the wall. The chest on top is only used for storage while the chest at the bottom is used for otherwise. If you open it and have a look, you will see two doors. There is a small hole with a height of 50 centimeters behind the second door. It’s a postern. Since the roads in the Ancient Troop-Hiding Cave extend in all directions, the defending troop, whether being a general or soldiers could transfer to a safe place through the postern and attack the enemies breaking into the cave. In Ming Dynasty, generals are ranked by the helmets they wear. The rank of this helmet is not high among the four ranks judged from the material of the helmets, whether being gold, silver, copper or iron. However, with the geographical advantage of being a pass that one man can hold out ten thousand, a general with ordinary rank is sufficient enough for the Ancient Troop-Hiding Cave.\r', '将军洞处于藏兵洞中心位置，由客厅和卧室两个部分组成，相对较为高级，这是古代等级制度的体现。在将军洞里最玄妙的地方是墙壁上的这个储物柜，上层的柜子仅做储物之用，下面的这个柜子却另有玄机，您不妨打开看一看，打这里出现两道门，第二道门后有一个高约五十公分的小洞，这是一个暗道，由于藏兵洞内道路四通八达，一旦有敌人闯进洞内，无论将领还是士兵都可以从暗道转移到安全的地方，从其他地方围攻敌人。在明代，将军等级以头盔来划分，在金银铜铁四个等级中，这个头盔等级并不高，但藏兵洞占有一夫当关、万夫莫开的地理优势，因此设一般等级足以。\r', '/jiangjundp.mp3', '/jiangjundy.mp3', '/jiangjundf.mp3', null), ('9', 'Doors between Life and Death', '生死门', 'Doors between life and death, just as its name implies, they are choices for life or death. On the left side is the way out, a simple aisle. The door on the right leads to death, because hidden weapons and tricks are installed here. One has to watch the steps carefully because once any tricks are triggered, arrows would be shot. It is impossible for anyone to takes this way out. Moreover, if the enemies enter the passageway of the “doors between life and death”, soldiers from Ming Dynasty could come along from side holes and shut both doors so that enemies would be trapped inside.', '生死门，顾名思义，即有生有死，左边生门，就是一个简单的过道，右边死门，因为这里会设置暗器和机关，走的时候可以留意脚下，这些机关启动以后会有箭头射出，进入此路可谓九死一生。另外当敌人进入生死门的通道，明代士兵会从侧洞出来将两扇门关闭，使得敌人困于门内。\r', '/shengsimenp.mp3', '/shengsimeny.mp3', '/shengsimenf.mp3', null), ('10', 'Underground Tunnel', '坑道', 'What we are passing through is the major part of Ancient Troop-Hiding Cave—underground tunnel. It is used for army mobilization, passage, attack or entry to the cave in wartime. In peacetime, it serves as the shelter for soldiers. Mud huts are located on both sides of the underground tunnel. The function of the hut varies depending on its size. Some shallow ones are for stand guard. Some are used as common room or duty room while others are used for storing goods and materials.\r', '大家正在通过的就是藏兵洞的主体构成部分——坑道，坑道是战时用于军队调运、通行、出击或进入洞内的通道，平时可作为兵士的休息住所。坑道的左右两侧辟有土屋，土屋大小不同，其作用也不尽相同，有些入深较浅，是为站岗的岗位。有些用作休息室或作值班之用，还有一些便是储藏物资的场所了。', '/1haokengdaop.mp3', '/1haokengdaoy.mp3', '/1haokengdaof.mp3', null), ('11', 'Soft Rope Tactics.Trap Board and Rolling Log', '软绳阵、翻版及滚木', 'The setup of soft rope tactics is actually not that destructive. However, after going through the previous gates of hell, psychological warfare is initiated here. Even if the enemies see how the hidden weapons are installed, they dare not advance without careful consideration. The place covered by wooden board before soft rope tactics is another trap－the Trap Board. A roller is installed in the middle of the board for control. The board would be turned over when any side is stepped on. The enemy would fall into a trap as deep as 3 meters, with sharp-pointed bamboos installed as hidden weapons. Anyone who falls into the trap would certainly get killed. On the other side, the big log is the rolling log which is usually used together with stones. This is what they call “rolling logs and thunderstones” . They could be used to attack the enemies from the top of the gorge.\r', '软绳阵的设置事实上没有太大杀伤力，可是经过前面几道鬼门关，这里可以打心理战，即使看见暗器如何设置，也不敢贸然前进。前方木板铺起来的地方仍然是一个陷阱——翻板，中间有轴控制，踩动木板任意一头，木板就会翻过来，敌人便落入陷阱，深3米，也有削尖的竹子作暗器，掉下去必死无疑。旁边这个大木桶便是滚木，一般和石块一同使用，正所谓滚木雷石。可以用在大峡谷的上面攻击敌人。\r', '/gunmup.mp3', '/gunmuy.mp3', '/gunmuf.mp3', null), ('12', 'The Great Wall Museum in Ningxia', '宁夏长城博物馆', 'Out of the Ancient Troop-Hiding Cave, you will arrive at the general administration. “Ba Zong” was a government position in Ming Dynasty. It was the military officer guarding a fort. This position is equivalent to a current battalion commander. There were 251 soldiers stationed in Red Mountain Fort in the Ming Dynasty and were led by the Ba Zong who quartered in the fort.\r\rThis Ba Zong’s office was discovered in 2007 by Huiming Wang who was a researcher of Ningxia Archaeological Research Institute when excavating and clearing up Red Mountain Fort. The foundation of the office was then buried in ruins. Archaeologists discovered large amount of tiles and building components from Ming Dynasty, as well as the well-preserved foundation. Experts restored the shape and structure of the buildings according to the distribution of foundation and the piled tiles and building components, and they got to know from documentary records that this building was the Ba Zong’s office for Red Mountain Fort of Ming Dynasty. In 2008, we restored, rebuilt it and developed it as ‘The Great Wall Museum in Ningxia ‘ according to the research findings by the experts. It includes two exhibition rooms which introducing the origin, building process and historical significance by models, words and images.', '走出藏兵洞，您到达的是把总署。把总，是明代的官职名称，是守卫一个堡寨的军事长官，相当于现在的一个营长。在红山堡，明代常备军有251名，由驻堡的把总统领。\r这处把总署，是2007年由宁夏考古研究所王惠民研究员主持发掘清理红山堡时发现的。当时，把总署的地基埋在废墟中，清理过程时，发现大量明代砖瓦及建筑构件堆积，并且发现了保存完好的地基。专家们由此复原了这组建筑的形制，并根据文献记载，知道这组建筑便是明代红山堡把总署，2008年，我们根据专家的研究成果，我们恢复重建了明代把总署，并将其开辟为“宁夏长城博物馆”。它分为两个展厅，以模型、文字、图片说明等方式介绍长城的起源、修筑及历史意义。\r', '/ningccbowup.mp3', '/ningccbowuy.mp3', '/ningccbowuf.mp3', null);
COMMIT;

