-- ----------------------------
--  Table structure for `cangbingdongtwo`
-- ----------------------------
DROP TABLE IF EXISTS `cangbingdongtwo`;
CREATE TABLE `cangbingdongtwo` (
  `id` int(11) NOT NULL,
  `en_name` varchar(100) DEFAULT NULL,
  `cn_name` varchar(100) DEFAULT NULL,
  `en_desc` mediumtext,
  `cn_desc` mediumtext,
  `voiceurl0` varchar(100) DEFAULT NULL,
  `voiceurl1` varchar(100) DEFAULT NULL,
  `voiceurl2` varchar(100) DEFAULT NULL,
  `url` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `cangbingdongtwo`
-- ----------------------------
BEGIN;
INSERT INTO `cangbingdongtwo` VALUES ('1', 'Troop-Hiding Cave No2', '二号藏兵洞', 'The tunnel we are visiting now, was cleaned up from June 2009 to September 2012. Total length of the tunnel is 2600 meters and covers an area of 6,850 square meters. It is connected to the tunnel opposite, constitute a complete underground defensive system together.', '我们参观的这段洞道，从2009年6月开始至2012年9月，历时三年多的时间所清理出来的，总长2600米，面积约6850平方米，它与对面的洞道互相连通，共同构成一个完整的地下防御体系。\r', '/2cangbingp.mp3', '/2cangbingy.mp3', '/2cangbingf.mp3', null), ('2', 'Porcelain', '瓷器', 'At the time of cleaning up the Troops-Hiding Cave, we found some Ming porcelains and pieces of blue and white porcelains. These here are same as found in the Red Mountain Fort, there are all household utensils such as porcelain jars, porcelain pots, porcelain bowls and some broken pieces. It’s very pity that all blue and white porcelain were broken pieces, this might be related to the blue and white porcelain is thin and fragile. The porcelain craft was well developed in the Ming Dynasty which had become a necessity of people\'s daily life and craft decorations from these unearthed cultural relics.\r', '在清理藏兵洞时，在洞穴和洞道内发现了一些明代瓷器及青花瓷器残件，和在红山堡发现的一样，有瓷罐、瓷壶、瓷碗、瓷缸及瓷器残片等生活器皿。非常可惜的是青花瓷器都是一些破损的残片，这可能和青花瓷器较轻薄、易碎有关吧。从这些出土的文物可以看出明代瓷器工艺非常发达，已经成为了人们日常生活的必需品和工艺装饰品。\r', '/ciqi2p.mp3', '/ciqi2y.mp3', '/ciqi2f.mp3', null), ('3', 'Traps', '陷阱', 'In front of you are the most common facilities in Troop-Hiding Cave—traps. Its depth is nearly 4 meters. Residual wood and iron sword were found while the cleaning job. After querying a large number of historical materials, we speculate that the weapon that was placed in a trap with the form what we see now. It was shaped like a mace and can be twirled. When the enemy fell into the trap, they would not only be stabbed but also twisted in the trap, dead as a doornail.', '眼前看到的是藏兵洞最常见的配套设施——陷阱，其深度近4米，清理时在里面发现有木片、铁剑的残留，在查询大量史料后，我们推测，当时置于陷阱中的武器即为大家现在所看到的模样，它形似狼牙棒，并且可以转动，掉入陷阱中的敌人不仅被刺伤，并且将绞于其中，必死无疑。\r', '/xianjingp.mp3', '/xianjingy.mp3', '/xianjingf.mp3', null), ('4', 'The Tunnel', '坑道', 'The tunnel we are passing now is a natural stalactite tunnel which using ingenious the million years wind and rain erosion based on local conditions. On this basis, people built up a combat tunnel net that can be used in transfer, conceal and it is easy to rely on. The stalactite we usually talk about is a generic name for calcium carbonate deposits which stalactite, stalagmites and columns formed in their long geological history and particular geological conditions. The soil stalactite forest landscape in front of us was called “Sheep Liver Soil” or “White Stiff Soil” by local people. It’s white and firm as rock. It always looks like rock if doesn\'t be soaked in water. Furthermore, it is indeed very similar to stalactite under the light. Their shapes look like all sorts of strange things, like bamboos shoots, columnar, curtain, grape, flowers, animals and man which are clear, vivid and lifelike. You can use your imagination to define them.\rWhat we are passing through is the major part of Ancient Troop-Hiding Cave—underground tunnel. It was used for army mobilization, passageway, attack or entry to the cave in wartime. In peacetime, it served as the rest shelter for soldiers. Troop-Hiding Cave was built as military defense system at the time of Ming Dynasty. Whereas, it had another role, that was a place for the border trade. This was also a great discovery when we cleaned this section of Troop-Hiding Cave. Private handicraft industry has continued to develop and grow in the middle and late Ming Dynasty, So Tea-horse trade has gradually emerged which promoting the integration of political and economic of agricultural and nomadic people.', '大家现在通过的这段洞道是明代士兵因地制宜，巧妙利用万年风雨侵蚀形成的天然钟乳石洞道，并在此基础上布局开凿而成的既能隐蔽、转移，又便于依托作战的地道网络。我们通常说的钟乳石是指碳酸盐岩地区洞穴内在漫长地质历史中和特定地质条件下形成的石钟乳、石笋、石柱等不同形态碳酸钙沉淀物的总称，大家眼前的土林“钟乳石”景观，在当地民间称为“羊肝子土”或“白僵土”，洁白且坚如岩石，如果不在水中浸泡，它永远都呈岩石状，在灯光下，确如钟乳石一般，因此我们将它称之为土林“钟乳石”。 它们形状千奇百怪，笋状、柱状、帘状、葡萄状，还有的似各种各样的花朵、动物、人物，清晰逼真，栩栩如生。你可以发挥您的想象力，赋予他们更多的内涵。\r而现在大家正在通过的，就是藏兵洞的主体构成部分——坑道，坑道是打仗时用于军队调运、通行、出击或进入洞内的通道，平时可作为兵士的休息场所。藏兵洞在明代的时候，主要是作为军事防御体系而建的，可它还有另外一个作用，那就是边关互市的交易场所，这也是我们清理这段藏兵洞的重大发现。明朝中后期，民营手工业不断发展壮大，以茶叶和马匹为代表的茶马互市逐渐兴起，促进了农耕民族和游牧民族的政治、经济的融合和优势互补。\r', '/kengdaop.mp3', '/kengdaoy.mp3', '/kengdaof.mp3', null), ('5', 'Stone Net Array and Crossbow Machine', '石网阵及连弩机', 'First we see the stone net array, it consists of two parts: a panel that can be reversed and mechanical gears under the panel, the rope full of stones hanging on the top and connect with the mechanical gears under the panel. If enemies come inside the tunnel and step on the panel, trigger the mechanical gear, rope net would fall down, kills the enemy and seal the hole at the same time. Making the enemy afraid to move forward, then the defenders eliminate them all from the behind.\rYou can see the crossbow machines In front of your left, there are wooden gears in the middle of the crossbow, sharp arrows shoot out if you step on the foot of a wooden board, it can burst nine sharp arrows a time. According to records, crossbow machine first appeared in the Warring State Period. Crossbow machines were not largely used after that period. ', '首先大家看到置于此处的石网阵，它由两部分组成：即道口下方的正中设一木制翻版，板下设置机关，顶部悬挂有绳网装满石块，石网和翻版下的机关相连，若有敌军进入洞内，脚下踏上翻版，触动机关，顶上的石网落下，既可致敌于死命，又可封住洞口，使后续敌军无法前进，守军再断其退路，将其消灭。\r在您左前方，看到的便是连弩机，在其中间有木质齿轮，踩动脚下木板便会有利箭射出，一次性可以连发九只。据记载，连弩机最早出现在春秋战国时期，再之后的历代中使用的并不广泛。\r', '/shiwangzhenp.mp3', '/shiwangzheny.mp3', '/shiwangzhenf.mp3', null), ('6', 'Iron Cage Array', '铁笼阵', 'Iron Cage Array is consists of three parts: first is the reversible panel on the ground with mechanical gears under it, the second is a downward opening iron cage that hung on the top, the third is iron wood door with multiple arrow holes which points at cave entrance which is facing the path to come in. The mechanical gear that under the panel is also connect with the iron cage, when the enemies step on the panel, trigger the mechanical gear, the iron cage would fall down and trap the enemies. Then the archers shot behind the door from the arrow holes, eliminate all the enemies who could hide nowhere.', '铁笼阵由三部分组成：一是地面上的翻板，板下设置机关，二是顶部悬挂一只下开口的铁笼，三是洞口设置有多个箭孔的铁页木门，正好对准来路的直道，翻板下的机关也和铁笼相连，当来敌踏动翻板，触发机关，铁笼落下，将直道左拐的敌军罩在铁笼中，且封闭左拐的道口。木门后的弓箭手则于箭孔中不断射箭，处于直道中的来敌无处躲藏，即被消灭于地道中。\r', '/tielongp.mp3', '/tielongy.mp3', '/tielongf.mp3', null), ('7', 'Underground passageway', '地下通道', 'You have no idea where we are now, we are now walking under the entire valley which located in the deepest place whose deep is about 30 meters, so you will feel particularly cold and wet in this tunnel. After this part of the tunnel, we are going to the Troop-Hiding Cave opposite the valley, Troop-Hiding Cave on both sides of valley are connected by those underground passageways. The complete tunnel of Troop-Hiding Cave was about 3 kilometers and winded along the whole valley, both up and down or left and right were connected which formed an extensive tunnels net. Troop-Hiding Cave, the Great Wall, the valley and the fort together constituted a three-dimensional military defense system. These are the historical evidence that what remarkable wisdom ancient Chinese embodied in fighting against invaders. According to historical records, in Ming Dynasty, Tartar and Wala had invaded many times, but never broke the Red Mountain Fort. We believe it was in relation to the defensive function of Troop-Hiding Cave defense system.', '您现在一定想不到我们正行走在整个峡谷的下方，处在入地最深处，深约30米，所以大家会感觉到洞道特别潮湿阴冷。经过这一段，我们将要到达峡谷对面的藏兵洞。峡谷两侧的藏兵洞就是依托这些地下的通道连为一体。藏兵洞整体洞道达三公里长，蜿蜒曲折于峡谷绝壁之中，形成上下相通、左右相连、四通八达的地道网。它与长城、峡谷、沟壑、城堡等共同构筑成内外相连的立体军事防御体系，是古人发挥聪明才智、利用地道游刃有余、抗击入侵者的历史见证。据史书记载，明代鞑靼、瓦剌贵族多次从灵州至盐州拆墙南下，入侵掠夺，但从未攻破红山堡，这可能跟藏兵洞防御体系发挥的重大作用有关。\r', '/dixiatongp.mp3', '/dixiatongy.mp3', '/dixiatongf.mp3', null), ('8', 'Martial Art Practicing Hall', '演武厅', 'Martial Art Practicing Hall is the biggest cave of the Troop-Hiding Cave, about 40 square meters, 6 meters high. It was firstly used for the soldiers to practice martial art and work out after the castle was encircled. There are lounges on both sides of the cave. The lounge on the right side is furnished with a wooden door. In front of the door, there is a platform, on which the head of the defending troops can rest or sit to watch martial arts fight each other. The lounge on the left is the place where orders are given or serves as the residence of the judger.\rThere are wood benches in the other rooms following with waiting room. Officers and soldiers sited here for watching shows. 18 kinds of weapons that are used for show are located in front of Martial Art Practicing Hall. Except for Wushu show, soldiers organized wrestling and games in this hall for fun. There is a well in the Martial Art Practicing Hall. After cleaning it, the well keeps the original appearance and water in it. The well was important for soldiers and it has been existed for hundreds years.', '演武厅是藏兵洞最大的洞穴，面积约四十平方米，高约六米。演武厅最初为城堡被围后，转入洞内的守军于此演练武艺、击技、强肌健体之用。洞两侧有休息室，尤以右侧洞室装饰有木制门，门前有平台，为守军把总休息或于平台上坐地观武；左侧洞室为发号施令或评判者居室。\r休息室以后的大厅内排设木制长凳，供非演武将士观看时的坐席。洞厅前墙壁处，左右兵器架上放置十八般兵器，供演武时使用，也使演武厅增加了武穆气氛。到后来，这里除演武外，也进行角逐等军中娱乐和游戏，以调剂军中生活，又可供将士宴饮用。厅中这口古井，于今清理出土后，仍保持了明代古井的原貌，井中有水，是解决明时戍军饮水问题的重要军用设施，起码已历数百年历史', '/yanwup.mp3', '/yanwuy.mp3', '/yanwuf.mp3', null), ('9', 'Live-action Performance <Dance and Music Drama of Northern Sahel>', '大型实景马战-北疆天歌', 'Ningxia is the frontier of north defense and the crucial town of national border. The Great Wall with 1,500 kilometers long was built in Ningxia district in different dynasties. Hence, Ningxia was also called ‘the Natural Museum of Great Wall ’. Because of its particular location, various nationalities were existing and extinct in Ningxia. Civilization of Hordes, farm and merchant reject and blend for thousands of years, so the unique culture of Ningxia emerged there. \r\rShuidonggou that located in the front-middle part of north defense formed the military defensive barrier based on the Great Wall, Grand Canyon, Troops-Hiding Cave and Red Mountain Fort. Because of its crucial location, Shuidonggou became a significantly military district. \r\rThe Grandly Epic War Horses of China Original Live-action Performance  <Dance and Music Drama of Northern Sahel> was based on Shuidonggou military defensive barrier in 12-13 Century. Professional Mongolian horsemen and 100 horses, camels, yak and fighting vehicles form the battle formation. War and peace, national rise and fall are the principal line. The beginning story about thrilling robbery on merchants of central plains and rescue by Mongolia cavalries happened in the Old Silk Roads and ancient barrier battlefield in Shuidonggou. Meanwhile, we would also witness the friendship and hostility between Temujin and Jamukha from their childhood to youth. At last, Temujin who was honored as Genghis Khan （1162-1227） later unified Mongolia and became the King of Yuan Dynasty. No more wars happened near the Great Wall. In Shuidonggou area, Mongolian and merchants of central plains built up friendly relationship in the Red Mountain Fort Bazaar. Therefore, the Golden Merchant Road turned into the significant road of peaceful life between Ningxia and Mongolian, even the significant road of Chinese live and reproduce. This live-action performance took 2 years by a Chinese director and a Mongolian director. The Mongolian warriors show their flexible tactics, excellent horseback riding and fierce fight with brave and wisdom. Alongside with the Great Wall, Grand Canyon and Troops-hiding Cave in Shuidonggou, you would definitely enjoy the natural combination of human, horses and scenery.\r\rShow time: 11:30am, 4:00pm and 8:30pm.', '宁夏自古就是祖国北部边防前线和边塞要地，历代修筑长城的总长度达1500多公里，素有“天然长城博物馆”之称。因其所处的独特地理位置，历史上很多民族在这里出现，又从这里消失，千百年来，游牧文明、农业文明、商业文明在这里撞击、交融，形成并支撑了宁夏地区独特的历史文化底蕴。\r地处宁夏边防前线的水洞沟，凭借长城、大峡谷、藏兵洞、红山堡共同构成的军事防御屏障，使这里成为了兵家必争的军事要地。\r中国首部大型实景马战史诗剧《北疆天歌》，就是以这个中国唯一保存完整的军事遗址：长城、大峡谷、藏兵洞、红山堡这个堪称天险的军事屏障为实景；以12-13世纪为历史背景；以来自蒙古国的专业骑队演员以及精挑细选100多匹骏马、骆驼、牦牛和数辆仿真战车为演出阵容；以战争与和平、民族兴衰为主线，演绎了发生在长城内：古丝绸之路的黄金商道也是古边塞战场——水洞沟地区的一次货物运输和中途遭受抢劫，最后被蒙古骑兵营救的故事情节；同时再现了长城外：铁木真从童年到青年的成长过程以及和好友札木合之间感人肺腑的家国情仇。最终，铁木真逐渐强大统一了蒙古部落成为草原大汗，长城内外迎来了相对祥和和安宁的时期，草原民族与中原商人在茶马之路的“马市”上相互往来，交换货物。黄金商道也成为了中华民族繁衍生息的血脉之路以及草原民族与宁夏人民休戚与共的生命之路。它是由我国著名导演和蒙古导演历时2年打造的一场荡气回肠的英雄史诗。该剧气势恢宏，高潮迭起，来自蒙古的彪悍骑士们，用他们旋风一般的速度、灵活的作战技术、精湛的马术，演绎了蒙古人狼一般的血性和横扫世界的强悍气势。而他们利用大峡谷、长城、藏兵洞这个天然的军事防御体系的完美演绎，更是将演出效果达到了人、马、景合一的震撼效果。\r\r演出时间：中午11：30一场，下午4：00一场，晚上8：30一场。\r', '/beitiangep.mp3', '/beitiangey.mp3', '/beitiangef.mp3', null);
COMMIT;

