BEGIN;
INSERT INTO `place` VALUES ('1', 'South Gate of Shuidonggou Scenic Spot', '水洞沟南门', 'Hello, My name is Master who comes from Simple Family in Shuidonggou. Welcome to visit in Shuidonggou Scenic Spot. Our family provides guiding explanation with Chinese, English or localism. We hope you could enjoy the trip by our explanation. \r\rShuidonggou is the most beautiful scenic where you should not miss it. It is also called as Time Tunnel, because it is the only place in China where passing from the Great Wall 500 years ago to 40,000 years ago. Shuidonggou Scenic Spot located in Shuidonggou Village in Linhe Town in City of Linwu in Ningxia Province. It located on the edge of southwest of Taidi in Ordos. Shuidonggou located 24 kilometers far on the east of capital city Yinchuan and 12-18 kilometers far from the Yellow River. Furthermore, Shuidonggou has the distance of 11 kilometers far from Hedong Airport. Thus, Shuidonggou is close to Transport. Shuidonggou has 7.8 square kilometers, which is the only Paleolithic Site by officially excavated in the region of Yellow River in China. It is one of the earliest excavated Paleolithic Sites in China. It is honored as “the birthplace of prehistoric archaeology in China”, “The historical evidence on cultural exchange between China and western countries”. Shuidonggou is also listed as one of “the 100 archaeological discoveries on the most significance about Chinese Civilization ” by China. It is National 5A Tourist Scenic Spot, National Key Cultural Relics Protection Units, National Geological Park. What’s more, Shuidonggou is the most intact three-dimensional system of military defense about the Great Wall in China. Shuidonggou can be literally comprehended as “Water Cave Channel” in Chinese. Because of restless rivers, cave eroded by yellow river and channel formed by flowing stream.', '您好，我是来自水洞沟Simple家族的Master，欢迎您来到水洞沟景区参观游览，我们家族将为您提供中文、英文、宁夏方言三种语言的讲解。希望通过我们的讲解，能让您更好得了解水洞沟。\r\r水洞沟是宁夏之旅最不可错过的景区，是中国唯一从长城通向四万年文明的时空隧道，它位于宁夏灵武市临河镇水洞沟村，地处鄂尔多斯台地西南边缘，西至首府银川市24公里，西距黄河12～18公里，距离河东机场11公里，有远离闹市、临近首府银川的地理优势，景区总面积15平方公里，是中国最早发掘的旧石器时代文化遗址之一，被誉为“中国史前考古的发祥地”、“中西文化交流的历史见证”，被国家列为“最具中华文明意义的百项考古发现”之一，国家5A级旅游景区，是全国重点文物保护单位、水洞沟还是我国唯一保存最完整的万里长城立体军事防御体系。因为这里有常年流淌不息的河流，有流水最终汇入黄河而经过的石拱洞，有流水冲刷形成的边沟，所以名为“水洞沟”。\r', '/1namenp.mp3', '/1nameny.mp3', '/1namenf.mp3', null), ('2', 'Shuidonggou VR Game <Mystery Stone from Heaven>', '水洞沟VR游戏 – ‘天降神石’', 'The VR Game of Shuidonggou is called <Mystery Stone from Heaven>. It was created by Simple Culture and Creativity Co.Ltd. This masterpiece is developed on Unreal Engine 4 and adopts HTC VIVE as the VR Game equipment. What’s more, it got some awards about VR Game. In the game, you would act as an archaeologist in Shuidonggou. In 2008, you dug a small piece from a magic stone. With doubt and curiosity, you went into the world of Shuidonggou’s period when was 40,000 years ago (Quaternary Glaciation) and explored the origin and secret about this stone. The scene of game located in a maze in Grand Canyon. You would learn how to drill wood to make fire to survive, make stone implement, search the ancient roll, kill the wooly rhinoceros, and collect the skeletons from an elegant princess and other clues to unravel the spectacle and secret of Shuidonggou. When you finished the task in Grand Canyon, you would also face the challenges from the Great Wall of Ming Dynasty and Troop-Hiding Cave. The VR Game was designed elaborately and good for educating. You would not only enjoy the fantastic VR Technology, but also witness the wisdom from our ancestor in Shuidonggou.', '水洞沟VR游戏名叫《天降神石》，由北京森魄文化创意团队打造，是基于UE4游戏引擎开发，采用全球最先进的VR设备HTC VIVE，获得多个VR游戏类奖项。玩家将会扮演水洞沟科考的一位考古学家，在2008年的某一天他发掘到了一块神奇的石头碎片，在睡梦和疑惑中他穿越到了四万年前的水洞沟，探寻到了关于这块神石的起源和秘密。游戏设置在大峡谷的迷宫之中，玩家需要学会钻木取火、制作石器工具、寻找卷轴、刺杀披毛犀、收集公主遗骸等线索来探索水洞沟当时的繁荣景象和那个不为人知的秘密。当玩家顺利通过四万年前的大峡谷后，你会发现眼前还有五百年前危险重重的明长城和藏兵洞在等待着你的探索……游戏主线设计精巧，并且寓教于乐，让玩家体验虚拟现实完全沉浸感的同时也能亲身见证当时人类祖先聪明的才华。\r', '/vrshenship.mp3', '/vrshenshiy.mp3', '/vrshenshif.mp3', null), ('3', 'Stone Square', '石器广场', 'Excavated stone implements can represent the time feature of Shuidonggou. With stone implements mentioned, we can see that the stone implement model standing on the three stone pillars in front of us is the model of unearthed magnified excavated scraping implement. At one or both ends of the scraping implement, there are edges for ancient people to cut animal skins or plant roots. The implement resembles the small cutting knife nowadays. Scraping implements are one of the most frequently excavated implements of Shuidonggou. The ancient people living here use such simple implements for hunt activities. These old stone implements stand for a key that would decode secret of the origin in the Old Stone Age.', '在水洞沟最能代表水洞时代特征的是出土的石器，说到石器我们看前方三根石柱上方的石器模型，它是在水洞沟出土的刮削器放大后的模型。刮削器的特征是一端或两端有刃，在古时候是用来切割动物兽皮和植物根径的工具，跟我们现在用的小刀的作用非常类似，刮削器也是水洞沟出土数量最多的器型之一。生活在这里的原始先民就是用这些简单的工具从事狩猎活动。一件简陋而又粗糙的石器，就像一把钥匙，打开了破译旧石器时代文明发祥的大门。\r', '/shiqiguangchangp.mp3', '/shiqiguangchangy.mp3', '/shiqiguangchangf.mp3', null), ('5', 'the Museum of Shuidonggou Relic', '水洞沟遗址博物院', 'Sculpture, Live-action, exhibiting panel, historical relics, spectra vision accompanied with audio guide formed the Museum of Shuidonggou Relic together. They helped visitors know about the origin of human, culture about Shuidonggou, process and result from the 5th excavation in Shuidonggou relic. Meanwhile, visitors could watch and feel the view about production and normal life of ancient people, migration of Shuidonggou because of disasters about flash flood, volcano eruption, mountains fall and the earth splits 40,000 years ago.', '水洞沟遗址博物院以雕塑、实景、展板、幻影成像、文物展示以及讲解的形式，让我们了解人类进化的起源、水洞沟文化以及水洞沟遗址五次考古发掘的过程与成果。同时，还有10分钟的实景体验，让我们身临其境感受四万年前原始人生产、生活以及面临山洪暴发、山崩地裂的灾难时被迫迁徙的场景。\r', '/bowuguanp.mp3', '/bowuguany.mp3', '/bowuguanf.mp3', null), ('6', 'Zhangsan Tavern', '张三小店', 'It has been long time for the first archaeological excavation, but the story is praised far and wide. During the 12 days when Rijin De and Zhihua Sang spent on the first excavation, they were welcomed by Zhangsan couple. Zhangsan tavern was a small lodge for temporarily rest. The shop owner Zi Zhang was called Zhangsan by public, because he was ranked third in his family. We restored Zhangsan tavern to memorize the farmer Zhangsan and his tavern that had contributed a lot to the discovery of Shuidonggou site in 2006. The tavern inherited northwestern construction feature in China. We also restore the decorative style and facilities in it.', '关于水洞沟遗址的首次考古发掘，虽已时隔遥远，但是关于这次考古发掘的佳话却一直保留至今。德日进与桑志华第一次考古发掘历时12天，在这期间他们住在“张三小店”，并且得到了张三夫妇的热情款待，关于“张三小店”，是上世纪二十年代水洞沟地区的一家车马店，店主人张梓因为家中兄弟排行老三，所以人们习惯称他“张三”，而他经营的小店就被称为“张三小店”。为了纪念为水洞沟遗址发掘做出突出贡献的张三与他得出小店，我们于2006年复原了“张三小店”，它秉承了大西北特有的土坯建筑，店中的一系列配套设施也都还原了二十年代西北人的特点。\r', '/sanshopp.mp3', '/sanshopy.mp3', '/sanshopf.mp3', null), ('7', 'Shuidonggou Village', '水洞沟村', 'Ancestors of North part of China invented a living type that included cave dwelling type and cave type. Those structures were usually built on mountain slope or gully land. They were cool in summer and warm in winter. People in Shuidonggou improved those two types into semi-subterranean dwellings. People dig a crypt on slope of yellow mountain, then they used adobe to build wall. After that, they used branches to build the top structure and used dry grasses, mud to pave the top which would prevent the house from getting wet. Shuidonggou village is the ancient half under-ground buildings inherited from prehistoric time. They are usually called “Diwozi” by people from Northwest part of China. There are 29 ruins of ancient semi-subterranean in Shuidonggou. We restore some of them so travelers here could know about this construction type directly.    \r\rThis village had been mentioned for several times by Rijin De (P.Teilhard de Chardin) in his report on the expedition and excavation of Shuidonggou site in 1920s. There are 29 round, square or oblong pits as ancient dwelling ruins located in the small village, whether being shallow or deep. There are also cave dewellings and soil build bungalows alongside of the soil stalactite forest. According to the textual research of the experts, this is the ancient half under-ground buildings inherited from prehistoric time. Such pit dwellings and cottages built by rammed earth were still in use back in 1960s.', '古老的水洞沟村是由北方的先民们创造了窖洞式和地穴式的居室方式。这种居室往往是建在黄土层较厚的山坡或沟岸上，具有冬暖夏凉的特点。古老的水洞沟村人在此基础上改进了这种居住方式，发展成一种半地穴式建筑形式。其方法是在黄土坡上先挖出一定深度的地穴，然后在地穴四壁确定为墙壁的地基上，用土坯（pī）垒墙，使之达到一定高度，再以桁（xíng）条，木椽搭顶，复以柴草，柴草上面糊以泥土，防止漏水。水洞沟村就是这样一个古老的半地穴式的聚集村落遗址，我国西北地区群众习称其为“地窝子”。水洞沟村聚落共有29处地穴式建筑遗址，我们选择了其中的一些进行了恢复，让我们能够直观地了解先民们的居住形式。\r\r水洞沟村是被德日进在他的水洞沟遗址考察发掘报告中多次提到的“水洞沟村”。在这个上世纪20年代就已经存在的小小村落中，布列着29处圆形、方形、长方形浅地穴、深地穴的古老民居遗址和两处依土林台地而建的窑洞和土筑平房。据专家考证，这里是自史前到上世纪20年代延续下来的古人类居址。这种穴居建筑以及土房建筑在上世纪60年代还在使用。\r', '/donggcunp.mp3', '/donggcuny.mp3', '/donggcunf.mp3', null), ('8', 'Landmark Stele', '尖状碑', 'This is the landmark building of Shuidongggou Scenic Spot. It resembles of NO.9 pointed implement excavated in Shuidonggou. The model is magnified with modern material with 8 meters in height and 5.6 meters in width. The paleolith in Shuidonggou cultural ruin site is forged by hard siliceous limestone, which shows that Shuidonggou ancient people had mastered a comparatively advanced stone-chipping technique. They found siliceous limestones  (cobblestone) on the bay of Qingshui river or ravines of mountain, then made cobblestone with round blade by smashing it. Ancient people regarded it as weapon on cutting or smashing animal. \rSuch pointed implement is one of the unique implements in Shuidonggou as it is rarely seen in other relics of the same age in China. After analyzing technological level and delicate degree of those stone implements, we can draw a conclusion that the implements production level of Shuidonggou has reached the highest level in the world at that time.', '水洞沟景区的标志性建筑，它是仿照水洞沟出土的编号为9号的尖状器，用现代材料放大制作而成，它高8米，宽5.6米。水洞沟文化遗址的旧石器，是用十分坚硬的硅质灰岩打制而成的，这说明水洞沟人已经掌握了比较先进的打制技术。他们从附近的清水河床或山间沟壑拣来硅质灰岩砾石(俗称鹅卵石)，用另外一块石头砸打，打去了它们在河床上磨擦出的圆棱，形成薄刃，就可用来砸兽骨，割兽肉，也可用做武器。\r这种器形在同一时期其它遗址中很少见，属于水洞沟独有的器形之一。从水洞沟出土的石器，装饰品的工艺水平，精致程度分析，当时的水洞沟人的生产水平（即打造石器的水平）达到了同时代最先进、最高水平。通俗一点的比较，当时水洞沟人的生产水平相当于现今美国工业的发达程度。\r', '/jianbeip.mp3', '/jianbeiy.mp3', '/jianbeif.mp3', null), ('9', 'Excavation Site No.1 and No.2', '一、二号遗址发掘点', 'There are 12 sites of relics excavation. The groove right in front you is site No.1 which is significant site in Shuidonggou. Zhihua Sang and Rijin De unearthed in 1923. After 4 times excavation in 1923, 1960, 1963 and 1980, we found huge cultural remains. The top section of No.1 groove is Neolithic period which possesses lots polished stone axe. The bottom section is Paleolithic age which has lots of chipped stone implements, decorations and traces of using fire. The period of this section is between 30,000 years ago to 20,000 years ago.   \rThe one in step shape is the excavation site No.2. Zhihua Sang and Rijin De found it in 1923. China Institute of Vertebrate Paleontology and Paleoanthropology expedition and Ningxia Institute of Archaeology processed 4 times excavations in 2003, 2004, 2005 and 2007. Accumulated area they found is 100 square meters. Remains were mass in 5 cultural layers which distributed in middle and lower. Archaeologists unearthed pyre, ash, sintering soil, pedants of ostrich eggshells and polished bone objects. That indicated people lived here before. The period of this section is between 30,000 years ago to 20,000 years ago.', '水洞沟一共有十二个遗址发掘点，对面有凹槽的是一号遗址点：由桑志华和德日进于1923年发现，1923、1960、1963和1980年进行过4次发掘，出土了大量文化遗物，是水洞沟旧石器文化的标志性地点。凹槽以上出土了磨光的石斧等，属新时期时期。凹槽以下出土了大量的打制石器和少量的动物化石、装饰品和用火遗迹，属旧石器时代。该地点旧石器时代层位的年代大约为3-2万年。\r分布成台阶状的为二号发掘点：由桑志华和德日进于1923年发现，2003、2004、2005年和2007年由中科院古脊椎动物与古人类研究所和宁夏考古研究所进行了4次发掘，累计发掘面积约100平方米。遗物集中的文化层有5个，文化遗址主要分布在中下层。目前出土的文化遗物包含火堆、灰烬、红烧土、鸵鸟蛋皮串珠装饰品和磨制骨器等遗迹，表明古人类曾以此未居住地。该地点的生存年代从距今3万年前后断续到距今2万年左右。\r', '/12kaogup.mp3', '/12kaoguy.mp3', '/12kaoguf.mp3', null), ('10', 'Reed Flower Valley', '芦花谷', 'Dear visitor, we will pass through the Reed Flower Valley with 1.5 kilometers long. Most of them are cultivated by human. The water source comes from Qingshui River with distance of 28 kilometers. This is the longest green scenic spot in Shuidonggou. In spring and summer, reeds shake slightly in many carriages. In autumn and winter, reeds look like flying snow. Along with the 8 meters high cliff, they form unique and mystery scenery in northern part of China.', '现在我们要通过的是芦花谷，它全长约1.5公里，大部分芦苇是人工培育出来的。这里的水源来自28公里处的清水河源头，这是我们景区最长的一道绿色景点，春夏时，芦苇摇曳，一片葱绿可爱，秋冬时，芦花如雪，白色的芦苇瑟瑟，与两岸高约8米的断崖峭壁共同构成了独具特色而又充满神秘色彩的塞上江南景观。', '/luhuap.mp3', '/luhuay.mp3', '/luhuaf.mp3', null), ('11', 'Mountain Temple', '山神庙', 'You would see the relics of Mountain Temple. From its shape, the floor space is not too big. However, this construction was majestical with imbricate tiles sideling on the roof. Inferring from the rest of the tiles, this mountain temple was not used until Qing Dynasty. At the same time, there are 3 carved stones, 2 of them are drum pole pedestals which are used on fastening flags on both sides of the gate. The other one is the decoration stone which is also called ‘face stone’. They should be on the two sides of gate, but we just find one.', '您看到的是山神庙遗址，从形制上看，占地面积不算太大，但当初的建筑却十分宏伟，是一座歇山顶式的覆瓦建筑。从残存的砖瓦来看，经过修缮，这座山神庙一直延用到清代。同时，还有三块精致的石刻，两个是位于营府门前的鼓型旗杆座，左右各一块，它们代替了古时的夹杆石，是用以固定插在杆座中的军中大旗的。另一个是府门前的装饰石，俗称“石面”，本应有两座，分立于府门前，左右各一。\r', '/shanshenp.mp3', '/shansheny.mp3', '/shanshenf.mp3', null), ('12', 'Lake of Mandarin Duck and Evil Town', '鸳鸯湖与魔鬼城', 'Now, left side in front of us is Lake of Mandarin Duck which is a salt lake. It is almost 100,000 square meters and the depth of lake is 3 to 4 meters. The lake goes in harmony with wide desert, Grand Canyon and the Great Wall. The whole scenery is a visual feast which is also called ‘frontier of small Jiangnan’. Between spring and summer, there are a lot of aquatic birds flying and swimming on the lake. The most birds are mandarin ducks, so people named this lake as Lake of Mandarin Duck. Recently, crowds of red-crowned crane got together in this area. They became friends of mandarin. \rBeside of mandarin lake, that is the evil town. Actually, it is a Yadan landform accompanied with soil stalactite forest. It records the historical procedure of geologic changes. Dry basin Eroded from Early Oligocene Epoch \r (70 million years ago) to Late Holocene (1 million years ago), then the dry basin which looked like an abandoned town for more than 10 million years became the Evil Town. When you step into this town, you will see the shabby soil stalactites standing here lonely. The body of mountain is worn-out and shows multiple shapes. From different angles under the sun, you will see different demons’ appearances by shadows. Furthermore, from sky view, it looks like a square town. Thus, we named it as ‘Evil Town’. Growing tanglesome grasses make you feel the sense of history in drift sand in Yadan landform. The miserable sound would come out when wind blows. Moreover, the volume of sound changes dramatically according to the changes of wind scale. The sound sounds like bellow of evil, so people named this area as ‘Evil Town’.', '现在，我们前方左手边看到美丽的湖泊就是鸳鸯湖。湖水面近10万平方米，水深3至4米，是水洞沟常年涓涓不断的细流，挟带着地表的盐分，汇集而成的一个咸水湖，不过水中盐分并不太高。来到这里，我们置身于大漠深处的湖光山色之中，粗犷的大漠，横亘的远峰，巍峨的长城，波光粼粼的湖水，构成了宁静，柔和，统一的和谐之美。在这里，我们深切体味到的是“大漠孤烟直，长河落日圆”的雄浑气魄和“平湖如镜水清涵，山翠天光荡蔚兰”的塞上江南风情。每当春夏之交，常有多种水鸟在湖面上游弋，见到最多的是成对成双的鸳鸯，因此人们把这个湖称作“鸳鸯湖”。近年来，湖面上又多见鹤群悠游，更为鸳鸯湖增添了一大胜景。\r在鸳鸯湖的旁边，我们会看到魔鬼城，所谓“魔鬼城”，实际上是一处独特的雅丹地貌土林景观，记录了比较复杂的地质过程和环境历史。经过数万年的风雨剥蚀，自上渐新世(约开始于六、七千万年前)干旱盆地沉积到全新世晚期(约一百万年以前)沉积的地貌，被大自然鬼斧神王地造就了这种像一座被遗弃了千万年的古城一样的地貌景观。走进这座魔鬼城，风雨剥蚀的土柱像凋零的古塔，巍然峭立，断崖绝壁像残断的城墙，裂裂缺缺。它们各自具有的不同形体，很容易引起人们不尽的遐想，从不同的角度看，它们似是传说中的各种魔鬼的形象；而从总体来看，这里又像是一座城垣，因此被人们称做“魔鬼城”。“城”内堆积的流沙，是沙漠地带雅丹地貌特有的景观，再加上丛生的荒草，使人倍感历史的沧桑。但这里被称之为魔鬼城，还有一个更重要的原因。就是每当大风刮起，这里会发生各种奇怪的声音，像尖厉的哨声，又伴随着低沉的长啸，或夹杂着类似悲凄呜咽的哭声。随着风力的不同，各种声响也不尽相同，似有千般变化，很容易联想到传说中的魔鬼们发出的各种长啸，悲凄等声响，令人毛骨悚然，而被当地百姓称之为“魔鬼城”。\r', '/mochengp.mp3', '/mochengy.mp3', '/mochengf.mp3', null), ('13', 'The Great Wall of Ming Dynasty', '明长城', 'To build up defending against the invasion from Tartar and Wala, Ming Dynasty have never stopped building the Great Wall. In the first year of Hongwu (1368) during the Ming dynasty. Emperor Yuanzhang Zhu sent General Da Xu to build the walls in Juyongguan Pass and other places. In the 14th year (1381) of Hongwu, the Shanhai Pass and other walls were built. The Great Wall were built in Ming Dynasty started from Yalu River in the east and ends in Jiayu Pass in the west, with a total length of almost 4000 miles. Within the territory of Ningxia province, the Great Wall is divided into north Great Wall, west Great Wall and east Great Wall.\r   We are now looking at the east Great Wall. It started from the Heng City along the east coast of the Yellow River. The Great Wall goes through the lingwu city, Yanchi City in NingXia province and reached in Dingbian County in Shanxi province. The total length of this part is more than 300 kilometers. This is now the integrated soil Great Wall of Ming dynasty. The Great Wall forms the boundary between NingXia and Inner Mongolia. 500 years ago, it was the national boundary which one side is NingXia town which was ruled by Ming dynasty and the other side lived Mongolian tartar tribe. Nowadays, not only can you experience one step across the two provinces, but also fell the step across two countries.\rBeacon tower was built on the Great Wall at intervals of every 150 to 200 meters. These beacon towers were dedicatedly built for military alerting. Smoke was released at daytime, while fire was highly held at night for alerting through one beacon tower after another. If a couple to a hundred enemies were discovered. One beacon-fire would be lighted at one tower. Two beacon-fires would be lighted at two towers for 500 enemies found. Three for more than 1,000 enemies found. Four for more than 5,000 enemies and five beacon fires with five gunfire for more than 10,000 enemies found. In general, each beacon tower was equipped with flag, drum, crossbow, rope ladder, cannon rock, gunpowder, fire arrow, dung of wolves and cows, firewood etc. In this way, military intelligence could be passed to a town or administrative district. Such ancient alerting method was honored as “the earliest application of wireless in the world”. In ancient times, the beacon-fire was the military warning signal when the enemy attacked. However, someone whose name is Youwang Zhou didn’t think it’s serious. For the smiling face of his beauty Bao Si, after hearing the Shifu Guo’s advice, he tricked his vassals by igniting the fire. The beauty smiled, but he lost his country, even his life. That story demonstrated that the essential role of the beacon-fire in ancient military.\r', '为了防止鞑靼和瓦剌贵族的南侵，明代在200多年间，几乎没有停止过修筑长城。洪武元年(1368年)，明太祖朱元璋就派大将军徐达修筑居庸关等处长城，洪武十四年(1381年)又修筑山海关等处长城。明长城东起鸭绿江，西至嘉峪关，全长12700余里，在宁夏境内分布为北长城，西长城，东长城。\r我们现在看到的是东长城，起自黄河东岸的横城，经宁夏灵武、盐池，入陕西定边县，全长3百多里。它也是明代土夯长城中保存较为完整的一段。以长城为界，一边是内蒙，一边是宁夏，五百多年前，这里曾是国界，一边是明王朝统治的宁夏镇，另一边是蒙古鞑靼部落，如今，您不仅可以体验一脚跨两省，还可以感受一脚跨两国。\r在长城墙体上，每隔150-200米就有烽火台。专用于军事报警，白天燃烟，夜间举火，依次递相燃放，若见敌一、二人至百余人，举放一烽一炮；五百人二烽二炮、一千人以上三烽三炮；五千人以上四烽四炮；万人以上五烽五炮。每座烽火台，通常都配备有旗帜、鼓、弩、软梯、炮石、火药、火箭、狼粪、牛粪、柴草等。这样军情很快就可传报到镇或州所。这种古老的报警方式，被誉为“世界上最早的无线电”。烽火台本是古代敌寇侵犯时的紧急军事报警信号，可有人就不按规矩办事，他是谁呢？他就是周幽王，周幽王为搏美人褒姒一笑，听取虢（guǒ）石父的建议，烽火戏诸侯，美人是笑了，不仅丢了江山，自己性命都不保。可见烽火在古代军事上的重要性。\r', '/mingccp.mp3', '/mingccy.mp3', '/mingccf.mp3', null), ('14', 'The Red Mountain Lake', '红山湖', 'The red mountain lake dam was a small and low dam on shuidonggou, which was built by the local famer for storing the water in those years.\rWhen we climb onto the top of the dam, a special landscape of “smooth lake rising in the narrow gorges” is found. The lake was named ‘the Red Mountain Lake’ because of locating in the Red Mountain area. The Red Mountain Lake was formed by water from the ditch with abundant water supply, stretching 2 kilometers to the East. There are eagles and cranes flying in the sky, mandarin ducks and wild ducks swimming among the water plants. With green weeds everywhere, the scenery in the mountain is quite amazing.\rFrom here, we can visit the Great Wall built along the water by taking a boat and sense the harmony between human beings and birds, as well as the unique temperament and interest of viewing reflected Great Wall and cliff in the water and enjoying the blue sky and white cloud mirrored at the bottom of the water. Such southern type scenery that combines the thought of “oneness of man and nature”, historical culture and current ecology is quite hard to come by. It may be called “with a boat running on the blue waves, visitors are traveling in a pictorial world”.\r', '水洞沟红山湖大坝是当年本地农民为蓄水，在这里建立的一道低矮的拦水石坝。\r登上坝顶，我们眼前呈现的是“高峡出平湖”的又一奇特景观，这片湖面因位于红山地区，所以名为“红山湖”。“红山湖”也是蓄积边沟之水而成的，丰水期，湖面可于峡谷中向东延伸2公里多，上空常有鹰鹤翱翔，水面上时有鸳鸯、野鸭游弋，山中野草青青，景色非常优美，\r我们乘船游览水岸长城，可以体验人与水鸟和谐共处；长城、断崖倒映水中；蓝天白云，映于水底的别样情趣。这种天人合一，历史文化和当今生态有机结合的塞上江南景观，实属不可多得，真可谓“舟行碧波上，人在画中游”。\r', '/hshanhup.mp3', '/hshanhuy.mp3', '/hshanhuf.mp3', null), ('15', 'Red Mountain Fort Bazaar', '红山堡互市', 'The “Horse Bazaar” is also known as the “Bazaar”. It’s a market opened at Red Mountain Fort area to barter with Mongolia, Wala and Tartar in the Ming Dynasty. At that time, the nomadic people of Mongolia and Tatar set up tents here. They exchanged for Han nationality cloth, silk, iron pot and other goods with gold and silver, cattle, horses, beast skins, dairy products and wool hat. The tent of the blacksmith, Draper, wool shop, grocery store and other shops opened by people of all ethnic groups formed a 1.5 mile trading market in the most active time of the transaction. When the opening time, a lot of people of all ethnic groups came to go to the market, so the market was very lively. The opening of the horse bazaar made Mongolian obtain the goods through the normal way, also solved the problem of inadequate supply of quality horses and enhance the military strength of Ming Dynasty. It played an important role in the peace and tranquility of the border.', '红山堡（Pu第四声）“马市”，也称边贸“互市”，是明代在红山堡一带开设的与蒙古、瓦刺和鞑靼之间的一种以物换物的交易市场。当时，蒙古、鞑靼等游牧民众在此搭设帐篷，以金银、牲口、马匹、兽皮、奶制品以及毡帽等物品来换取汉民族的布匹、丝绸、铁锅以及其他物品。各族民众在此开设的铁匠铺、绸缎铺、绒线铺、杂货铺等各种商铺和帐篷，在交易最活跃时，形成了长达四五里许的交易市场。每当开市之时，前来赶市的各族民众人数众多，马市异常热闹。马市的开设，使蒙古人通过正常的手段获得了物品，也解决了明朝优质军马供应不足的问题，增强了明朝的军事实力，对边境的和平和安宁起到了重要的作用。\r', '/huship.mp3', '/hushiy.mp3', '/hushif.mp3', null), ('16', 'The Grand Canyon', '大峡谷', 'Between Shuidonggou and the Red Mountain Fort, there is a 4 kilometers canyon which is nature’s masterpieces. However, in Ming Dynasty, it became an important part of the Great wall “Deep Ditch and High Barrier” defensive system. The sides of the canyon have been weathering all the year crossed by hills and ravines. After the long term of weathering by the rain, many earth-pillars have been formed out of the thick loess. They were reared into strange and marvelous shapes which also formed what we call the ‘soil stalactite forest’. The soil stalactite forests have been then manifested again by the uncanny craftsmanship of the nature and form various figures. Some of them look like a monk who is overlooking at high and expecting a new comer. Some look like lovers who relying on each other. Some of them look like a married couple who are holding their wedding ceremony, etc. All the figures and the shapes will give you endless reveries.', '从水洞沟到红山堡之间，有长约4公里的峡谷，本是大自然的“杰作”，但明代时，这又成了长城“深沟高垒”防御体系的重要组成部分。峡谷两岸经常年的风雨剥蚀，沟壑纵横，深厚的黄土经长期的雨水冲刷，土柱突兀壁立，造型奇特，形成了“土林”。“土林”又经大自然鬼斧神工般的雕琢形成千奇百怪的形像。有的像僧人登高远眺，似在期待来者；有的宛如一对恋人，相亲相依；有的如夫妻相敬，双方对拜，琳琳总总，各具形态，给人以无尽的遐想。', '/daxiagup.mp3', '/daxiaguy.mp3', '/daxiaguf.mp3', null), ('17', 'Live-action Performance <Dance and Music Drama of Northern Sahel>', '大型实景马战 - <北疆天歌>', 'Ningxia is the frontier of north defense and the crucial town of national border. The Great Wall with 1,500 kilometers long was built in Ningxia district in different dynasties. Hence, Ningxia was also called ‘the Natural Museum of Great Wall ’. Because of its particular location, various nationalities were existing and extinct in Ningxia. Civilization of Hordes, farm and merchant reject and blend for thousands of years, so the unique culture of Ningxia emerged there. \r\rShuidonggou that located in the front-middle part of north defense formed the military defensive barrier based on the Great Wall, Grand Canyon, Troops-Hiding Cave and Red Mountain Fort. Because of its crucial location, Shuidonggou became a significantly military district. \r\rThe Grandly Epic War Horses of China Original Live-action Performance  <Dance and Music Drama of Northern Sahel> was based on Shuidonggou military defensive barrier in 12-13 Century. Professional Mongolian horsemen and 100 horses, camels, yak and fighting vehicles form the battle formation. War and peace, national rise and fall are the principal line. The beginning story about thrilling robbery on merchants of central plains and rescue by Mongolia cavalries happened in the Old Silk Roads and ancient barrier battlefield in Shuidonggou. Meanwhile, we would also witness the friendship and hostility between Temujin and Jamukha from their childhood to youth. At last, Temujin who was honored as Genghis Khan （1162-1227） later unified Mongolia and became the King of Yuan Dynasty. No more wars happened near the Great Wall. In Shuidonggou area, Mongolian and merchants of central plains built up friendly relationship in the Red Mountain Fort Bazaar. Therefore, the Golden Merchant Road turned into the significant road of peaceful life between Ningxia and Mongolian, even the significant road of Chinese live and reproduce. This live-action performance took 2 years by a Chinese director and a Mongolian director. The Mongolian warriors show their flexible tactics, excellent horseback riding and fierce fight with brave and wisdom. Alongside with the Great Wall, Grand Canyon and Troops-hiding Cave in Shuidonggou, you would definitely enjoy the natural combination of human, horses and scenery.\r\rShow time: 11:30am, 4:00pm and 8:30pm.', '宁夏自古就是祖国北部边防前线和边塞要地，历代修筑长城的总长度达1500多公里，素有“天然长城博物馆”之称。因其所处的独特地理位置，历史上很多民族在这里出现，又从这里消失，千百年来，游牧文明、农业文明、商业文明在这里撞击、交融，形成并支撑了宁夏地区独特的历史文化底蕴。\r地处宁夏边防前线的水洞沟，凭借长城、大峡谷、藏兵洞、红山堡共同构成的军事防御屏障，使这里成为了兵家必争的军事要地。\r中国首部大型实景马战史诗剧《北疆天歌》，就是以这个中国唯一保存完整的军事遗址：长城、大峡谷、藏兵洞、红山堡这个堪称天险的军事屏障为实景；以12-13世纪为历史背景；以来自蒙古国的专业骑队演员以及精挑细选100多匹骏马、骆驼、牦牛和数辆仿真战车为演出阵容；以战争与和平、民族兴衰为主线，演绎了发生在长城内：古丝绸之路的黄金商道也是古边塞战场——水洞沟地区的一次货物运输和中途遭受抢劫，最后被蒙古骑兵营救的故事情节；同时再现了长城外：铁木真从童年到青年的成长过程以及和好友札木合之间感人肺腑的家国情仇。最终，铁木真逐渐强大统一了蒙古部落成为草原大汗，长城内外迎来了相对祥和和安宁的时期，草原民族与中原商人在茶马之路的“马市”上相互往来，交换货物。黄金商道也成为了中华民族繁衍生息的血脉之路以及草原民族与宁夏人民休戚与共的生命之路。它是由我国著名导演和蒙古导演历时2年打造的一场荡气回肠的英雄史诗。该剧气势恢宏，高潮迭起，来自蒙古的彪悍骑士们，用他们旋风一般的速度、灵活的作战技术、精湛的马术，演绎了蒙古人狼一般的血性和横扫世界的强悍气势。而他们利用大峡谷、长城、藏兵洞这个天然的军事防御体系的完美演绎，更是将演出效果达到了人、马、景合一的震撼效果。\r\r演出时间：中午11：30一场，下午4：00一场，晚上8：30一场。\r', '/beitiangep.mp3', '/beitiangey.mp3', '/beitiangef.mp3', null), ('18', 'Troop-Hiding Cave No2', '二号藏兵洞', 'The tunnel we are visiting now, was cleaned up from June 2009 to September 2012. Total length of the tunnel is 2600 meters and covers an area of 6,850 square meters. It is connected to the tunnel opposite, constitute a complete underground defensive system together.', '我们参观的这段洞道，从2009年6月开始至2012年9月，历时三年多的时间所清理出来的，总长2600米，面积约6850平方米，它与对面的洞道互相连通，共同构成一个完整的地下防御体系。\r', '/2cangbingp.mp3', '/2cangbingy.mp3', '/2cangbingf.mp3', null), ('19', 'Red Willow Marshes', '红柳滩', 'The origin of name of the red willow marshes had the reason that saline alkali were covered by many red willows. Red willow is a common shrub in the northwest of China. They normally grow in saline alkali land where water level is higher. They are called red willow because the trunk of the willow is dark red. Traditional Chinese medicine called it as “Chenghongliu”. The red wicker is very resilient, so wicker baskets made by the red wicker are strong and durable. According to the local people said the red willow marshes like a natural weather forecaster. When you found the willow flowers are particularly lush, it might go to rainning in the second day.', '“红柳滩”名称的由来，是因盐碱滩遍生红柳而得名的。红柳，是西北地区常见的一种灌木，往往生长在地下水位较高的盐碱地里，因株干呈暗红色而被称之为“红柳”，中医学上称之为“柽（chēng）红柳”。红柳枝条极有韧性，是编制箩筐的绝好材料，其制品结实耐用。据当地老百姓说：红柳是他们的天然气象预报员，当你发现红柳花开的特别繁茂时，这说明第二天就要下雨了。', '/hongliutanp.mp3', '/hongliutany.mp3', '/hongliutanf.mp3', null), ('20', 'Red Mountain Fort', '红山堡', 'Red Mountain Fort is named for located in Red Mountain area. It’s a city barrier of the Great Wall defense system in Ming Dynasty. This fort was built in the 16th year of Hongzhi emperor’s regime (in 1503). It has got a history of more than 500 years. “Red Mountain Fort” was under the jurisdiction of Ningxia military attache. It is a square and the length is 300 meters. People set an east gate for Red Mountain Fort which has a Barbican with the door opening to the south. The wall is 8 meters high, 7 meters wide at the bottom and the top is 4 meters thick. It was set up according to the defense system of Ming Dynasty, that is, cities to be built at every 20 miles and forts to be built at every 10 miles along the Great Wall.\r\rIn the 16th year of Zhengde emperor’s regime (in 1521), the minister of works and vice censor, who managed 3 provinces (Shanxi, Ningxia, Guyuan) named Qing Hong. He appointed chief commander of Ningxia Yongshi to extend Red Mountain Fort. 380 meters from north to south，320 meters from east to west, Barbican is 30 meters long and 20 meters wide. 251 soldiers, 1 Fort Guard officer and 1 Garrison Officer stationed in fort. We can also see the original housing base in the fort. According to the military system of Ming Dynasty, Every 5 people lived in a barrack, there should be more than 50 houses in Red Mountain Fort. We can see a lot of broken bricks and building debris in the northwest of the castle. Here is probably the officers’ residence. If it was not damaged, it should be a higher level of a grand building.', '红山堡是因位于红山地区而得名。它是明代长城防御体系中的一个城障，始建于明弘治十六年(1503年)，距今已有500多年。“红山堡”本属灵州千户所辖，其为正方形，边长均为300米，设东门一道，有瓮城，门向南开。墙高8米，底宽7米，顶厚4米，是按照明代长城沿线60里一城，30里一堡的防御体制设置的。\r明正德十六年(1521年)户部尚书兼右副都御史，总制三边(陕西、宁夏、固原)的秦纮，委派宁夏都指使史镛扩建红山堡，南北长约380米，东西长约320米；瓮城长30米，宽20米。堡内驻军251名，设守堡官员一名，操守官一名。城堡中，我们还可以看到原有的房屋基址。按明代兵制，每5人分住一间营房，红山堡应有50多间房屋。在城堡西北台地处，我们能见到大量残破砖瓦和建筑构件残片堆积。这里可能是守堡官员的住所，在没遭到破坏前，是一座档次较高的恢弘建筑。\r\r最初设置红山堡等城障时，主要有两个目的；一是加强长城线上的防守；二是“防秋”。所谓“防秋”古已有之，到了明代，鞑靼、瓦剌贵族仍然遵循突厥等游牧民族贵族的古例，就是往往于秋天马肥草盛之际，大举兴兵南侵，这时农耕还正值秋收季节。为此，从隋唐至明，每到这时就要调集大军戍边，以保护百姓秋收，因称之为“防秋”。但在客观上，其作用并不仅如此。如自嘉靖十年(1531年)，王琼筑“头道边”，实施“深沟高垒”后，使长城内的“宁盐大道”和陕北有屏障保护的交通大道相衔接，从而成为商运往来的“黄金商道”。另一方面，又在横山至清水营各城障设立驿站，是宁夏镇军事供应及军机文书传递、官员往来的必经之道，这就和“宁盐大道”共同构成了在军事保护下的两大主要交通线。另一重要作用，就是长城内外各族人民出入清水营“马市”及“牛羊小市”进行商品交易和商贸往来，红山堡是重要通道之一。', '/hongshanpup.mp3', '/hongshanpuy.mp3', '/hongshanpuf.mp3', null), ('21', 'Sand Jujube Bay', '沙枣湾', 'The terminal of our boat trip is Sand Jujube Bay, where Shuidonggou makes a bend with three sides surrounded by cliff and one side by water. The well-known sand jujube trees in Ningxia have grown in large areas, providing us shade under the sun. There are natural lawns, a reed lake with clear blue water, quiet and cool wooded roads, primitive thatched cottages and restaurants providing us water and food, making the Bay a “Paradise”. You will certainly be happy and have a romantic time here. For the most time of the year, it is a wetland here with green grass, a god-given resting place in Shuidonggou as well as a transfer station and base camp for hiking. If coming in early summer, you will be exposed to the fragrance and quietness of the natural beauty among sand jujube trees in blooming.', '我们乘船的终点站就是沙枣湾，水洞沟在这里拐了个湾，三面临崖，一面向水。宁夏著名的沙枣树连株成片，为我们遮阳避署。沟湾中有天然草坪，有碧水澄清的芦苇湖，有静谧凉爽的林荫，有古朴返真的茅草屋，有供我们疗饥解渴的饮食店，真不啻于“世外桃源”。相信大家会有一份好心情，在这里度过一段浪漫的好时光。一年中的绝大多数时间里，这里是一片湿地，绿草茵茵，是水洞沟难得的纳凉歇脚的好地方，也是我们徒步旅游水洞沟的中转站、大本营。如果我们初夏来到这里，沙枣花开，你会置身于清香幽静的美境之中。', '/shazaowanp.mp3', '/shazaowany.mp3', '/shazaowanf.mp3', null), ('22', 'North Area of Shuidonggou Scenic Spot', '水洞沟北区', 'Dear visitors! After visiting the relic of great wall of Ming dynasty, we will climb over it and go into the spryly wild plains of Inner Mongolia. Thus, the great wall of Ming dynasty is the border between Ningxia and Inner Mongolia. 500 years ago, there existing various hordes like Tarter and Wala. Nowadays, we could enjoy the combination of wild plains, desert and woods. Then, we could have a rest in the Mongolian Families in the spryly wild plains. After that, a troop of camels will take you to visit the Museum of Mongolia, surfing in the desert and experiencing motocross and other entertainment. Throughout the journey, we will also catch the sight of yaks, camels, horses and sheep.', '游客朋友们，大家好！参观完明长城遗址后，下一站，大家将翻越长城进入水洞沟北区到达蒙古野性草原。这里与宁夏仅一墙之隔。500多年前，这里是鞑靼、瓦剌等游牧民族驰骋的疆场，也是他们修养生息的地方。在今天，我们可以看到辽阔的野性草原与沙地、湖泊、林地的结合，接下来，我们可以在前方的野性草原蒙古人家稍作休息片刻，稍后会有草原驼队带您进入野性草原的深处去参观蒙元博物馆，体验沙漠冲浪、草原越野等刺激项目，沿途我们还会看到成群结队的牦牛、骆驼、马和羊等动物。\r', '/shuibeiqup.mp3', '/shuibeiquy.mp3', '/shuibeiquf.mp3', null), ('23', 'Traversing and Come Back', '穿越 归来', 'From 40,000 years ago human ruins to 500 years ago underground Troop-Hiding Cave. From prehistoric to frontier soldiers, Shuidonggou——A real journey through time and space, May the trip will bring you a deep and wonderful memories! Wish you a happy life! Bye!\r', '从四万年人类遗址到五百年地下兵城，水洞沟——真正的时空穿越之旅，愿此次旅行能带给您深刻而美好的回忆！祝您生活愉快！再见！', '/jieshuyup.mp3', '/jieshuyuy.mp3', '/jieshuyuf.mp3', null), ('24', 'The Mascot of Shuidonggou – SIMPLE Family', '水洞沟吉祥物Simple家族', 'Simple family is the mascot of Shuidonggou Scenic Spot. Simple family includes 4 characters that are Sweet with beginning letter of ‘S’, Idol with beginning letter of  ‘I’, Master with beginning letter of ‘M’ and Power with beginning letter of ‘P’. Sweet was born on September 12nd in the late of Quaternary Glaciation. She dreamt to become a wild animal trainer. Her personality looked like a man. She liked drawing and making ornaments. She was gifted with an extraordinary retentive memory. She recorded interesting matters about Shuidonggou Village by her drawing. The most regretful thing is that she was not there when her grandpa fighting with the wooly rhinoceros. Idol was born on January 31st in the late of Quaternary Glaciation. He was a little inventor with huge and strange imagination. His habit was collecting odd stones. He always invented interesting things with little uses. The so called ‘old man elevator ’ made his grandpa hurt, so he suffered lots of beating from his family. Whereas, he still insisted on his hobby. Master was born on January 16th in the late of Quaternary Glaciation. He was the chief of Shuidonggou Tribe. Many years ago, he fought with a wooly rhinoceros as a warrior in an extremely cold winter. As a result, he became the idol of young villagers. The scar on his face was remaining at that fight. To praise such a heroic story, the Shaman in tribe also gave a tattoo of totem onto his arm. Power is a little hunter who was born on November 9th. He saved a small leopard once and gave as a present to Sweet. He liked raising flowers, but failed to raise vileplume of his neighbor. His face would turn red after sawing the girl he likes. Because of his dark skin color, no girls would notice his affection. His final aim was becoming a warrior like his grandpa.', '森魄家族是水洞沟的吉祥物，其实森魄是英文单词Simple的英译。水洞沟森魄家族一共有四个人物，分别是字母S开头的Sweet，中文名字叫甜心；字母I开头的Idol，中文名字叫爱豆；字母M开头的Master，中文名字叫爷爷；字母P开头的Power，中文名字叫石头。Sweet甜心生于第四纪末次冰期9月12日，梦想成为驯兽师，标准女汉子，喜欢绘画、制作首饰。她有着过目不忘的本领，擅长墙绘，水洞沟村里大大小小的事件都被她画在山体上记录了下来。最大的遗憾是没亲眼看见爷爷与披毛犀搏斗的场景。Idol爱豆生于第四纪末次冰期1.31号，是个小发明家，他好奇心旺盛，思想天马行空，喜欢收集奇怪的石头。总是能发明出新奇的玩意儿，但基本上没什么卵用，他发明的“老人电梯”让爷爷摔坏了屁股。爱豆也没少挨过打，但是他依然热爱自己的爱好。Master爷爷生于第四纪末次冰期1月16日，现任水洞沟村的酋长，年轻的时候是一名善战的部落勇士，是周围所有部落年轻人的偶像。曾经于寒冬中大战狂暴的披毛犀保护了部落，脸上的伤疤就是那时候留下来的，身上还有部落萨满亲自为他画上的图腾以表扬这次伟大的事迹。Power石头生于第四纪末次冰期11月9日，是个打猎小能手，曾经救下来一只被剑齿虎咬伤的小豹子，后来送给了甜心，喜欢种花，但确养死了戈壁家的霸王花。看见喜欢的姑娘会脸红，但是由于脸太黑所以看不出来。梦想成为爷爷一样的伟大战士。\r', '/simplejiazup.mp3', '/simplejiazuy.mp3', '/simplejiazuf.mp3', null), ('25', 'Barbican', '瓮城', 'Mountain Fort is one of the important passageways. If you get a bird’s eye view of Red Mountain Fort you will find it looks like a turtle in general: Red Mountain Fort is the body of the turtle while the urn-shape Barbican is the head of the turtle. In peacetime, the main entrance of Red Mountain Fort is locked while the gate of the urn-shape Barbican is left half open. It will only be closed in the time of war in an attempt to kill the enemies inside the Barbican area. Therefore, a saying goes “catch a turtle in a jar”.\r\rWhen we cleaning the barbican in 2008, we found two skeletons with one man and one woman. This discovery generated huge discussions with die for love, homicide or earthquake. The reason why people said dying for love was that skeletons include one man and one woman. The reason why people said dying for homicide was that they would be killed by robbery because of Barbican’s unsafe location. We can notice that there was a tile inserting in the man’s waist and crack distributing on the woman’s head. Thus, people speculated with earthquake. However, guess is not fact, the specific reason cannot be verified. Life is so fragile, please take care of it.', '鸟瞰红山堡，整体像一只乌龟，红山堡是乌龟的身体，瓮城是乌龟的头部。平时红山堡正门紧闭，瓮城城门虚掩，在战事发生时才会关闭瓮城城门，把进入瓮城的敌人射杀在瓮城城内，因此有“瓮中捉鳖”之说。\r    2008年清理瓮城时，发现两具尸骨，一男一女。关于他们的死因，众说风云，殉情、他杀、地震灾害等。据推测，殉情主要是因为尸骨一男一女。他杀则源于红山堡处于宁蒙交界，境内不太安宁，常有强盗、土匪劫财杀人，二人在此可能惨遭不幸。我们看到，男尸腰间插了块儿瓦片，女性头骨有明显的裂痕，可能是受到了重物的袭击，因此有地震而亡这一说，但推测毕竟不代表事实，具体原因也无从考证，生命如此脆弱，请大家好好爱护！', '/wengchengp.mp3', '/wengchengy.mp3', '/wengchengf.mp3', null), ('26', 'Mongolian Dining and Entertainment Area of the Spryly Wild Plains', '野性草原牧家乐餐饮娱乐区', 'Now, the place we arrived is Mongolian Dinner and Entertainment Area of the Spryly Wild Plains. Inner Mongolia is known as the food heaven and the songs ocean, so we could taste delicious food from Mongolia and order campfire party and get accommodation in Mongolia yurt. The whole tour line is a circle. Hence, we reached the foot of great wall of Ming dynasty again. After crossing over the pedestrian bridge, we came back the south area of Shuidonggou. Later, we will take the boat to visit the beautiful Red Mountain Lake.', '现在我们到达的地方是野性草原牧家乐餐饮娱乐区。内蒙古被称为美食的天堂，歌的海洋，在这我们可以品尝蒙古特色美食，感受蒙古的餐饮文化，也可订制晚上的篝火晚会和住宿。我们的整个游线是环形路线，大家往前面看，不错，我们又回到了长城脚下，再次翻越长城天桥，就又回到了水洞沟南区。下一站，到达红山湖码头，我们将乘船游览红山湖。', '/canyinyulep.mp3', '/canyinyulepy.mp3', '/canyinyulef.mp3', null), ('27', 'Troop-Hiding Cave', '藏兵洞', 'Each and every black hole on both sides of the cliff in canyon is the famous scenery spot and historical site called “Troops-Hiding Cave”. The hiding cave actually indicates the move of defending troops at Red Mountain Fort transferring from overground defense to underground defense. It was used to protect the troops and wait for chance to attack the enemies or served as tunnel to ambush troops in open area. The Great Wall, tower, deep ditch, canyon and troop-hiding cave have constituted the only well-preserved ancient three-dimensional military defense system all over the country. The ancient troop-hiding cave in front of us is the relic and prototype of the earliest tunnel warfare in our country. If the tunnel warfare initiated by the 8th Rout Army and guerrilla forces made the enemies terror-stricken and tremble with fear during the War of Resistance against Japan, we can also imagine that the defending troops at the frontier fortress of Ming Dynasty had kept the invaders outside the Great Wall with the same wisdom and courage 500 years ago. The troop-hiding caves are 10 meters above the valley bottom which winding above and below or left and right in the mountain. There are many forks which look like maze in the cave so you cannot see the end. Besides, there are habitable rooms, food storage rooms, wells, kitchen stove, arsenal, powder magazine, traps and concealed weapons in the cave. You can appreciate the tunnel warfare with the unexpected design of the flexible function and the complex structures when you stand in the “troops-hiding cave”. The intelligence of ancient people is thoroughly demonstrated here. It is really amazing!', '在峡谷两侧悬崖上的一个个黑洞，就是著名的“藏兵洞”，所谓藏兵洞，是红山堡守军由地上转入地下，隐蔽军队，保护自己，伺机出击，或在空旷处设伏兵的地道。这在全国是唯一保存最为完整的古代立体军事防御体系。在我国的长城防御体系中，把长城、城堡和地下藏兵洞紧密联系在一起的防御系统，全国这是独一处。现在展现在大家眼前的藏兵洞是我国最早的地道战遗址和原型。如果说抗战时期，八路军和游击队的地道战能让敌人胆战心惊，闻风丧胆，那么我们可以想象500多年前明代的边塞守军也是以同样的智慧和勇敢将侵略者挡在了长城之外。 奇特的藏兵洞高出沟底10多米，蜿蜒曲折于悬壁之中，上下相通，左右相连，洞中分叉路口颇多，左右盘旋，犹如迷宫久久不见尽头。洞内辟有居室、粮食储藏室、水井、灶台、兵器库、火药库、炮台、陷阱、暗器孔道等设施。置身其中，可立时领略到古地道战在设计上的出人意料、功能上的灵巧隐蔽、结构上的悬妙复杂，古人的聪明才智，在这里体现得淋漓精致，令人叹为观止。', '/1cangbingdp.mp3', '/1cangbingdy.mp3', '/1cangbingdf.mp3', null), ('28', 'The Great Wall Museum in Ningxia', '宁夏长城博物馆', 'Out of the Ancient Troop-Hiding Cave, you will arrive at the general administration. “Ba Zong” was a government position in Ming Dynasty. It was the military officer guarding a fort. This position is equivalent to a current battalion commander. There were 251 soldiers stationed in Red Mountain Fort in the Ming Dynasty and were led by the Ba Zong who quartered in the fort.\r\rThis Ba Zong’s office was discovered in 2007 by Huiming Wang who was a researcher of Ningxia Archaeological Research Institute when excavating and clearing up Red Mountain Fort. The foundation of the office was then buried in ruins. Archaeologists discovered large amount of tiles and building components from Ming Dynasty, as well as the well-preserved foundation. Experts restored the shape and structure of the buildings according to the distribution of foundation and the piled tiles and building components, and they got to know from documentary records that this building was the Ba Zong’s office for Red Mountain Fort of Ming Dynasty. In 2008, we restored, rebuilt it and developed it as ‘The Great Wall Museum in Ningxia ‘ according to the research findings by the experts. It includes two exhibition rooms which introducing the origin, building process and historical significance by models, words and images.\r', '走出藏兵洞，您到达的是把总署。把总，是明代的官职名称，是守卫一个堡寨的军事长官，相当于现在的一个营长。在红山堡，明代常备军有251名，由驻堡的把总统领。\r这处把总署，是2007年由宁夏考古研究所王惠民研究员主持发掘清理红山堡时发现的。当时，把总署的地基埋在废墟中，清理过程时，发现大量明代砖瓦及建筑构件堆积，并且发现了保存完好的地基。专家们由此复原了这组建筑的形制，并根据文献记载，知道这组建筑便是明代红山堡把总署，2008年，我们根据专家的研究成果，我们恢复重建了明代把总署，并将其开辟为“宁夏长城博物馆”。它分为两个展厅，以模型、文字、图片说明等方式介绍长城的起源、修筑及历史意义。\r', '/ningccbowup.mp3', '/ningccbowuy.mp3', '/ningccbowuf.mp3', null);
COMMIT;

